"description": "<p>\u4f86\u8ac7\u8ac7\u7126\u616e <br />\u5982\u679c\u4f60\u6642\u5e38\u611f\u5230\u7126\u616e\uff0c\u89ba\u5f97\u81ea\u5df1\u8981\u4e09\u5341\u6b72\u4e86\u89ba\u5f97\u5fac\u5fa8\uff0c\u5feb\u56db\u5341\u6b72\u4e86\u611f\u89ba\u7126\u616e\uff0c\u5176\u5be6\u4e5f\u6b63\u5e38\uff0c\u5e78\u597d\u6709\u5e74\u9f61\u6578\u5b57\u64fa\u5728\u90a3\u88e1\u63d0\u9192\u6211\u5011\uff0c\u4e0d\u7136\u9084\u771f\u4ee5\u70ba\u6c38\u9060\u90fd\u662f\u5341\u4e94\u6b72\u5462XD <br />\u6240\u4ee5\u610f\u8b58\u5230\u5e74\u9f61\uff0c\u5c31\u7b97\u6703\u7126\u616e\uff0c\u6211\u89ba\u5f97\u4e5f\u4e0d\u662f\u58de\u4e8b <br />\u6703\u7126\u616e\uff0c\u4e5f\u610f\u5473\u6211\u5011\u300c\u5c0d\u81ea\u5df1\u7684\u6210\u9577\u9084\u4e0d\u5920\u6eff\u610f\u300d\uff0c\u4e5f\u4e0d\u60f3\u6eff\u8db3\u65bc\u73fe\u72c0\uff0c\u5176\u5be6\u662f\u903c\u81ea\u5df1\u751f\u51fa\u529b\u91cf\uff0c\u53bb\u6539\u8b8a\u73fe\u72c0\u3002 <br />\u4f60\u9748\u9b42\u633a\u6709\u91ce\u5fc3\u554a\uff0c\u4e0d\u60f3\u4f60\u53ea\u904e\u5c0f\u65e5\u5b50\u3002 <br />\u6240\u4ee5\u6709\u4e0d\u6eff\u610f\uff0c\u4ee3\u8868\u4f60\u89ba\u5f97\u81ea\u5df1\u53ef\u4ee5\u66f4\u597d\uff0c\u5c0d\u81ea\u5df1\u6709\u6240\u671f\u5f85\uff0c\u5c0d\u751f\u547d\u9084\u6709\u76fc\u671b\u3002\uff08\u54ce\u5466\u88ab\u6211\u8b1b\u5f97\u597d\u6b63\u80fd\u91cfXD\uff09 <br />\u8acb\u597d\u597d\u8ddf\u7126\u616e\u5920\u901a\uff0c\u8b93\u7126\u616e\u6210\u70ba\u6210\u9577\u7684\u990a\u4efd\u5427\u3002 <br /> <br />\u4eca\u5929podcast\u804a\u9577\u5927\u7126\u616e\uff0c\u4f60\u89ba\u5f97\u81ea\u5df1\u6709\u9577\u5927\u55ce\uff1f\u5fc5\u9808\u8aaa\uff0c\u6d3b\u5230\u9019\u628a\u5e74\u7d00\u6211\u90fd\u4e0d\u78ba\u5b9a\u81ea\u5df1\u5230\u5e95\u9577\u5927\u6c92\uff0c\u4f46\u6211\u6709\u8f49\u5316\u7126\u616e\u7684\u7d93\u9a57\uff0c\u9019\u96c6\u5c31\u628a\u7642\u7652\u7684\u65b9\u5f0f\u9001\u7d66\u5927\u5bb6\u3002 <br /> <br />#\u6709\u7642\u7652\u5c31\u6703\u8b8a\u7f8e\u5594\ud83d\ude06</p>",
