"description": "<p>\u3010\u5510\u7dba\u967d\u661f\u5ea7\u904b\u52e2\u9031\u583110/30-11/5\u3011 <br /> <br />\u3010\u7d2f\u7684\u3011\u7345\u5b50 \u5929\u79e4 \u5c04\u624b \u9b54\u7faf <br />\u7345\u5b50\uff1a\u7761\u7720\u554f\u984c\u5f71\u97ff\u8868\u73fe\uff0c\u611f\u60c5\u96b1\u6182\u8981\u591a\u6e9d\u901a <br />\u5929\u79e4\uff1a\u5de5\u4f5c\u53c8\u6025\u53c8\u591a\u8acb\u4fdd\u91cd\uff0c\u611f\u60c5\u6709\u58d3\u529b\u7576\u5fc3\u5927\u7206\u70b8 <br />\u5c04\u624b\uff1a\u5de5\u4f5c\u7576\u5fc3\u5634\u5feb\u5f97\u7f6a\u4eba\uff0c\u611f\u60c5\u8acb\u807d\u807d\u5c0d\u65b9\u89e3\u91cb <br />\u9b54\u7faf\uff1a\u5de5\u4f5c\u505c\u9813\u5c31\u7576\u4f5c\u4f11\u606f\uff0c\u611f\u60c5\u7684\u4ed8\u51fa\u518d\u591a\u60f3\u60f3 <br /> <br />\u3010\u7a69\u7684\u3011\u91d1\u725b \u8655\u5973 \u6c34\u74f6 \u96d9\u9b5a <br />\u91d1\u725b\uff1a\u5de5\u4f5c\u4e0a\u628a\u63e1\u81ea\u5df1\u6b65\u8abf\uff0c\u60a0\u7136\u7684\u6c23\u8cea\u80fd\u62db\u6843\u82b1 <br />\u8655\u5973\uff1a\u7e7c\u7e8c\u51b7\u975c\u4e00\u4ee5\u8cab\u4e4b\uff0c\u611f\u60c5\u4e0a\u5225\u6f51\u4eba\u51b7\u6c34 <br />\u6c34\u74f6\uff1a\u8077\u5834\u7576\u5fc3\u88ab\u4eba\u727d\u9023\uff0c\u611f\u60c5\u5bb9\u6613\u88ab\u91dd\u5c0d\u6216\u51fa\u554f\u984c <br />\u96d9\u9b5a\uff1a\u5de5\u4f5c\u9069\u5408\u5354\u529b\u5225\u592a\u6d6a\u6f2b\uff0c\u611f\u60c5\u6709\u5962\u4f88\u7684\u7169\u60f1 <br /> <br />\u3010\u8b9a\u7684\u3011\u7261\u7f8a \u96d9\u5b50 \u5de8\u87f9 \u5929\u880d <br />\u7261\u7f8a\uff1a\u5de5\u4f5c\u6709\u6210\u80fd\u653e\u9b06\u4e86\uff0c\u611f\u60c5\u80fd\u9760\u79ae\u7269\u5f4c\u88dc <br />\u96d9\u5b50\uff1a\u5de5\u4f5c\u9700\u9b25\u667a\u9b25\u52c7\uff0c\u611f\u60c5\u559c\u6b61\u5e7d\u9ed8\u7684\u6843\u82b1 <br />\u5de8\u87f9\uff1a\u8077\u5834\u4f54\u64daC\u4f4d\u8981\u6709\u4e3b\u898b\uff0c\u611f\u60c5\u6703\u50ac\u4fc3\u5c0d\u65b9\u6210\u9577 <br />\u5929\u880d\uff1a\u5728\u65b0\u968e\u6bb5\u81ea\u4fe1\u6eff\u6eff\uff0c\u611f\u60c5\u540c\u6a23\u6843\u82b1\u65fa\u65fa</p>",
