"description": "<p>\u98db\u5229\u6d66 X MOMO <br />\u96d911\u8d85\u72c2\u8cfc\u7269\u7bc0 <br />\u4e0b\u6bba5\u6298\u8d77\uff0c\u932f\u904e\u518d\u7b49\u4e00\u5e74! <br /> <br />\u23f3\u6d3b\u52d5\u6642\u9593: 10/26-11/13 <br />\ud83d\uded2\u99ac\u4e0a\u8cfc\u8cb7: https://momo.dm/eRqRzb <br /> <br />\ud83d\udce21111\u8cfc\u7269\u653b\u7565: <br />\u597d\u5eb71: \u5168\u9928\u6eff\u984d\u6700\u9ad8\u9001MO\u5e631111 <br />\u597d\u5eb72: \u5168\u81ea\u52d5\u7fa9\u5f0f\u5496\u5561\u6a5f\u9001\u77e5\u540d\u5496\u5561\u8c46\u3001\u9910\u5238\u3001\u8cea\u611f\u5bb6\u96fb\u7b49\u8c6a\u79ae <br />\u597d\u5eb73: \u6e05\u6de8\u6a5f\u6307\u5b9a\u54c1\u8cb7\u5927\u9001\u5c0f\uff0c\u6eff\u984d\u518d\u8d08\u8d85\u5546\u79ae\u5238500\u3001\u6c23\u6ce1\u6c34\u6a5f <br />\u597d\u5eb74: \u9664\u6fd5\u6a5f\u8cb7\u5c31\u9001\u96fb\u6696\u7210\uff0c\u4e00\u7d1a\u80fd\u6548\u4eab\u7bc0\u80fd\u88dc\u52a91200 <br />\u597d\u5eb75: \u6c23\u70b8\u934b\u3001\u842c\u7528\u934b\u6311\u6230\u5168\u5e74\u6700\u4f4e\u50f9\uff0c\u4e0b\u55ae\u4eab\u591a\u9805\u597d\u79ae+Mo\u5e63 <br />\u597d\u5eb76: \u639b\u71d9\u6a5f\u6307\u5b9a\u54c1\u8cb7\u5c31\u9001Ariel\u6d17\u8863\u7403 <br />\u597d\u5eb77: \u5616\u5616\u52df\u8cc7\u7834\u5169\u5343\u842c\u6f54\u5730\u6b66\u58eb\u6d17\u5730\u6a5f\uff0c\u4e0b\u6bba56\u6298 <br />\u597d\u5eb78: \u5237MO\u5361+MOMO\u96d911\u7d44\u968a\uff0c\u6700\u9ad8\u518d\u4eab7.5%\u56de\u994b <br />\u597d\u5eb79: \u98db\u5229\u6d66\u767e\u5e74\u54c1\u724c\u4f7f\u7528\u5b89\u5fc3\uff0c\u4eab\u5168\u7403\u5169\u5e74\u4fdd\u56fa <br />(\u8d08\u54c1\u6578\u91cf\u6709\u9650\u9001\u5b8c\u70ba\u6b62\uff0c\u6d3b\u52d5\u4f9d\u98db\u5229\u6d66\u8ce3\u5834\u516c\u544a\u70ba\u4e3b) <br />- <br />\u91d1\u661f\u53ea\u80fd\u804a\u611b\u60c5\u55ce\uff1fno\uff01\u7576\u7136\u4e0d\u6b62\uff0c\u5b83\u53ef\u662f\u7279\u5225\u7684\u5f88\u7684\u661f\u5462 <br />\u6240\u4ee5\u6211\u5011\u4eca\u5929\u4f86\u804a\u91d1\u661f\u5225\u7684 <br />\u50cf\u662f\uff0c\u91d1\u661f\u4e5f\u662f\u6211\u5011\u8eab\u4e0a\u6700\u5f15\u4ee5\u70ba\u8c6a\u3001\u6700\u4e0d\u9858\u610f\u6539\u8b8a\u7684\u5730\u65b9\uff0c\u6c92\u932f&nbsp;, \u5c31\u662f\u4f60\u300c\u89ba\u5f97\u81ea\u5df1\u6700\u6709\u50f9\u503c\u4e4b\u8655\u300d\ud83d\ude0d\uff0c\u4ee5\u53ca\u4f60\u7684\u300c\u50f9\u503c\u89c0\u300d <br />\u50f9\u503c\u89c0\u6709\u591a\u91cd\u8981\u5c31\u4e0d\u7528\u8aaa\u4e86\u5427\uff1f\u96e3\u602a\u6703\u5f71\u97ff\u611f\u60c5\uff0c\u8a8d\u77e5\u592a\u4e0d\u76f8\u540c\u7576\u7136\u50b7\u611f\u60c5 <br />\u60f3\u4e86\u89e3\u81ea\u5df1\u7684\u50f9\u503c\u89c0\u8ddf\u5225\u4eba\u6709\u4ec0\u9ebc\u4e0d\u540c\u55ce\uff1f\u4f86\u807d\u807d\u9019\u96c6\u5427\uff01\ud83d\udcaa <br /> <br />EP267\u83dc\u55ae\uff1a <br />\u91d1\u661f\u6c7a\u5b9a\u4f60\u7684\u4e09\u89c0 <br />\u8981\u8b93\u91d1\u661f\u96d9\u5b50\u4f69\u670d\u4f60 <br />\u4f60\u4ee5\u70ba\u91d1\u661f\u5929\u79e4\u597d\u8aaa\u670d\uff1f <br />\u91d1\u661f\u6c34\u74f6\u7684\u624b\u6a5f\u6bbc <br />\u65b9\u65b9\u6b63\u6b63\u7684\u91d1\u661f\u9b54\u7faf <br />\u91d1\u661f\u8655\u5973\u4e8b\u696d\u8981\u505a\u5927\u5fc5\u9808...&nbsp; <br />\u91d1\u661f\u91d1\u725b\u4e09\u500b\u6708\u5f8c\u624d\u6e9d\u901aXD <br /> <br /></p>",
