"description": "<p>\u9023\u5047\u56de\u4f86\uff0c\u8fce\u63a5\u5927\u5bb6\u7684\u662f10\u5bae\u98db\u661f\u300c\u4e0b\u96c6\u300d\ud83c\udf89\ud83c\udf89\ud83c\udf89 <br />10\u5bae\uff0c\u662f\u6211\u5011\u56e0\u6b64\u6649\u7d1a\u3001\u6210\u529f\u3001\u9047\u5230\u5927\u4eba\u7269\u7684\u5730\u65b9\uff0c\u6240\u4ee5\u98db\u661f\u98db\u5230\u54ea\u88e1\uff0c\u5c31\u662f\u300c\u8cb4\u4eba\u3001\u6210\u5c31\u300d\u4f86\u6e90\u4e4b\u8655\uff0c\u503c\u5f97\u6a19\u8a18\u3002 <br /> <br />\u4e0a\u96c6\u624d\u525b\u51fa\u98db1-6\u5bae\uff0c\u98db10\u5bae\u7684\u540c\u5b78\u5c31\u745f\u745f\u767c\u6296\u4e86\uff0c\u8aaa\u5f88\u64d4\u5fc3\u81ea\u5df1\u6703\u8d85\u7d1a\u8f9b\u82e6xd\uff1b\u98db12\u5bae\u7684\u540c\u5b78\u5247\u8aaa\u7121\u6cd5\u806f\u60f3\u81ea\u5df1\u300c\u6703\u5728\u54ea\u88e1\u6210\u529f\u300dxd\u2026. <br />\u597d\u5594\uff0c\u5927\u5bb6\u7684\u53cd\u994b\u6211\u901a\u901a\u6536\u5230\u4e86\uff0c\u4e0b\u96c6\uff0c\u98db\u5165\u300c7-12\u5bae\u300d\u7684\u8acb\u63a5\u62db\uff0c\u6bcf\u500b\u90fd\u6703\u597d\u597d\u8aaa\u660e\u7684\uff0c10\u5bae\u98db\u661f\u4e0b\u96c6\uff0c\u6211\u4f86\u4e86\ud83d\ude0a <br /> <br />EP262\u83dc\u55ae\uff1a <br />\u8001\u5e2b\u8072\u6a02\u5bb6\u5be6\u9304 <br />\u6dfa\u8ac7\u4e00\u4e0b4\u5bae\u98db\u661f <br />\u55aa\u5c4d vs \u4e0a\u53f8 <br />5\u98db7\u8ddf10\u98db7\u7684\u5dee\u5225 <br />10\u98db8\uff1a\u5927\u4eba\u7269\u7684\u6551\u706b\u968a <br />\u4e00\u8aaa\u8a71\u5687\u6b7b\u4eba\u768410\u98db9 <br />\u51e1\u4e8b\u722d\u7b2c\u4e00\u768410\u98db10 <br />10\u98db11\uff1a\u74b0\u4fdd\u5c0f\u5c16\u5175 <br />\u8d8a\u4e0d\u8a08\u8f03\u8d8a\u8a0e\u4eba\u559c\u6b61 <br />10\u98db12\u90fd\u5728\u6572\u7897</p>",
