"description": "<p>\u3010\u5510\u7dba\u967d10/9-10/15\u661f\u5ea7\u904b\u52e2\u9031\u5831\u3011 <br /> <br />\u2605\u5c0d12\u661f\u5ea7\u7684\u5f71\u97ff\uff1a <br /> <br />\u3010\u7d2f\u7684\u3011\u7261\u7f8a \u8655\u5973 \u9b54\u7faf \u96d9\u9b5a <br /> <br />\u7261\u7f8a\uff1a\u5de5\u4f5c\u53c8\u591a\u53c8\u7169\uff0c\u611f\u60c5\u8981\u78ba\u5b9a\u662f\u5c0d\u65b9\u6240\u9700 <br />\u8655\u5973\uff1a\u5de5\u4f5c\u9700\u914d\u5408\u8001\u95c6\u9577\u5b98\uff0c\u611f\u60c5\u5225\u628a\u5de5\u4f5c\u5e36\u56de\u5bb6 <br />\u9b54\u7faf\uff1a\u6ce8\u610f\u5bb6\u5ead\u6216\u5167\u90e8\u554f\u984c\uff0c\u611f\u60c5\u5bb9\u6613\u60b2\u89c0\u8981\u591a\u6e9d\u901a <br />\u96d9\u9b5a\uff1a\u5de5\u4f5c\u53c8\u591a\u53c8\u8d95\u597d\u5d29\u6f70\uff0c\u611f\u60c5\u614e\u9632\u661f\u706b\u71ce\u539f <br /> <br />\u3010\u7a69\u7684\u3011\u96d9\u5b50 \u5de8\u87f9 \u5c04\u624b \u6c34\u74f6 <br /> <br />\u96d9\u5b50\uff1a\u5de5\u4f5c\u9032\u5165\u7a69\u7d2e\u7a69\u6253\uff0c\u611f\u60c5\u4e0a\u5225\u592a\u50b3\u7d71\u56fa\u57f7 <br />\u5de8\u87f9\uff1a\u9047\u4e8b\u505c\u770b\u807d\u70ba\u4f73\uff0c\u611f\u60c5\u8981\u591a\u4fdd\u7559\u4e00\u9ede\u7a7a\u9593 <br />\u5c04\u624b\uff1a\u5de5\u4f5c\u7576\u5fc3\u88ab\u727d\u8457\u8d70\uff0c\u611f\u60c5\u6709\u5e74\u9f61\u5dee\u6200\u60c5 <br />\u6c34\u74f6\uff1a\u5de5\u4f5c\u4e0a\u76e1\u91cf\u52d9\u5be6\uff0c\u611f\u60c5\u5225\u81ea\u5df1\u5e7b\u60f3\u592a\u591a <br /> <br />\u3010\u8b9a\u7684\u3011\u91d1\u725b \u7345\u5b50 \u5929\u79e4 \u5929\u880d <br /> <br />\u91d1\u725b\uff1a\u5de5\u4f5c\u8981\u9867\u53ca\u5408\u4f5c\u5c0d\u8c61\uff0c\u611f\u60c5\u662f\u4e3b\u63a7\u7684\u4e00\u65b9 <br />\u7345\u5b50\uff1a\u5de5\u4f5c\u4e0a\u6709\u9577\u9060\u85cd\u5716\uff0c\u611f\u60c5\u8981\u7576\u5fc3\u5c0d\u65b9\u62b1\u6028 <br />\u5929\u79e4\uff1a\u5c0d\u5408\u4f5c\u65b9\u6848\u518d\u659f\u914c\uff0c\u611f\u60c5\u7684\u4e0d\u5e73\u8981\u53cd\u61c9 <br />\u5929\u880d\uff1a\u6d3b\u529b\u7a4d\u6975\u6709\u6548\u7387\uff0c\u9762\u5c0d\u611f\u60c5\u6e05\u6670\u4fd0\u843d</p>",
