"description": "<p>\u4f60\uff0c\u8a31\u9858\u90fd\u6703\u5be6\u73fe\uff0c\u9084\u662f\u300c\u5176\u5be6\u8a31\u5b8c\u5c31\u4e0d\u8a18\u5f97\u4e86\u300dXD\uff1f <br />\u904e\u5e7e\u5929\u53c8\u662f\u65b0\u6708\u8a31\u9858\u4e86\uff0c\u63d0\u9192\u4e86\u90a3\u9ebc\u4e45\u7684\u65b0\u6708\u8a31\u9858\uff0c\u5230\u5e95\u662f\u5f9e\u4f55\u800c\u4f86\uff1f\u771f\u7684\u6709\u4eba\u9858\u671b\u6210\u771f\u55ce\uff1f <br />\u4eca\u5929\u4e5f\u4f86\u804a\u804a\u300c\u600e\u6a23\u8a31\u9858\u300d\uff0c\u5225\u56e0\u70ba\u89ba\u5f97\u53ea\u662f\u8a31\u9858\u5c31\u5929\u99ac\u884c\u7a7a\uff0c\u77e5\u9053\u300c\u600e\u9ebc\u8a31\u9858\u6bd4\u8f03\u5bb9\u6613\u6210\u771f\u300d\u4e5f\u662f\u5f88\u91cd\u8981\u7684 <br />\u5148\u9810\u544a\uff1a\u5927\u5bb6\u53ef\u4ee5\u5148\u628a\u300c\u8655\u5973\u5f0f\u9858\u671b\u300d\u6e96\u5099\u597d\u5594 <br />\u554a\uff1f\u4e0d\u77e5\u9053\u4ec0\u9ebc\u662f\u8655\u5973\u5f0f\u9858\u671b\uff1f\u90a3\u5c31\u66f4\u5f97\u807d\u9019\u4e00\u96c6\u4e86 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u6b63\u78ba\u8a31\u9858\u6cd5 <br />\u6708\u4eae\u65e5\u7b46\u8a18\u672c <br />\u5510\u8001\u5e2b\u7684\u8655\u5973\u5ea7\u9858\u671b <br />\u8ddf\u6708\u8001\u8a31\u9858\u6709\u6210\u529f\u55ce <br />\u6eff\u6708\u7684\u6642\u5019\u4e0d\u8981\u4e82\u8a31\u9858 <br />\u4f60\u6703\u7528\u4ec0\u9ebc\u6700\u611b\u7684\u6771\u897f\u8a31\u9858 <br />\u2014\u2014\u2014\u2014\u2014 <br />\u300a\u8ff4\u8def\u82b1\u5712\u300b\u5c55\u6f14\u8cc7\u8a0a <br />\u7bc0\u76ee\u7c21\u4ecb\uff5c <br />\u5317\u85dd\u5927\u79d1\u6280\u85dd\u8853\u9928\u958b\u9928\u656c\u737b\u2014\u2014\u300a\u8ff4\u8def\u82b1\u5712\u300b\uff0c\u4f9d\u5efa\u7bc9\u7a7a\u9593\u7279\u6027\u6253\u9020\u4e00\u5834\u8de8\u9818\u57df\u6c88\u6d78\u904a\u8d70\u5100\u5f0f\u7684\u6f14\u51fa\uff0c\u6df7\u751f\u904b\u7528\u73fe\u4ee3\u79d1\u6280\u6cd5\u5668\uff0c\u5f15\u5c0e\u89c0\u773e\u5728\u79d1\u85dd\u9928\u4e4b\u4e2d\u5167\u5916\u7a7f\u68ad\uff0c\u8207\u5404\u7a7a\u9593\u7684\u79d1\u6280\u85dd\u8853\u4f5c\u54c1\u4e92\u52d5\uff0c\u9ad4\u9a57\u4e0d\u540c\u7684\u4eba\u751f\u8a66\u7149\u5834\uff0c\u7d93\u7531\u6de8\u5316\u7684\u904e\u7a0b\uff0c\u5728\u72c2\u6b61\u6d3e\u5c0d\u4e4b\u5f8c\uff0c\u4e00\u540c\u8e0f\u5165\u8fd4\u751f\u7684\u8def\u9014\u3002 <br />&nbsp; <br />\u555f\u552e\u65e5\u671f\uff5c2023.08.26 (Sat.) <br />\u5c55\u6f14\u65e5\u671f\uff5c10.21 (Sat.) 18:30\u300120:30 <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10.22 (Sun.) 18:30\u300120:30 <br />\u5c55\u89bd\u671f\u9593\uff5c2023.11.11 \u201412.10\uff08\u514d\u8cbb\uff09 <br />\u5c55\u6f14\u5730\u9ede\uff5c\u570b\u7acb\u81fa\u5317\u85dd\u8853\u5927\u5b78 \u79d1\u6280\u85dd\u8853\u9928 <br />\u8cfc\u7968\u9023\u7d50\uff5c<a href=\"https://www.opentix.life/event/1691793495188242432\" target=\"_blank\">https://www.opentix.life/event/1691793495188242432</a></p>",
