"description": "<p>\u6709\u60f3\u904e\u55ce\uff0c\u5982\u679c\uff0c\u660e\u5929\u662f\u81ea\u5df1\u7684\u6700\u5f8c\u4e00\u5929\u2026.\u4f5c\u70ba\u5929\u880d\uff0c\u4e00\u76f4\u5c0d\u751f\u6b7b\u8b70\u984c\u7279\u5225\u6709\u611f\uff0c\u4ee5\u524d\u5e38\u64d4\u5fc3\u7236\u6bcd\u8eab\u9ad4\uff0c\u89ba\u5f97\u4ed6\u5011\u6703\u6bd4\u6211\u5148\u8d70\uff0c\u4f46\u5176\u5be6\u2026\u8ab0\u77e5\u9053\u5462\uff1f\u8aaa\u4e0d\u5b9a\u5148\u8d70\u7684\u662f\u6211\u2026.\uff08\u5478\u5478\u5478\uff0c\u6572\u684c\u5b50\u4e09\u4e0bxd\uff09 <br /> <br />\u5982\u679c\u751f\u6b7b\u90a3\u9ebc\u7121\u5e38\uff0c\u6d3b\u8457\u7684\u6700\u5f8c\u4e00\u5929\u82e5\u9084\u5728\u70ba\u5c0f\u4e8b\u751f\u6c23\uff0c\u90a3\u4e0d\u662f\u5f92\u7559\u907a\u61be\u55ce\uff1f\u9019\u6b21\u7684podcast\u4f86\u8cd3\u662f\u898b\u8b49\u904e\u4e00\u5834\u53c8\u4e00\u5834\u6b7b\u4ea1\u5100\u5f0f\u7684\u846c\u5100\u793e\u793e\u9577\u2013\u5c0f\u51ac\u74dc\uff0c\u4ed6\u5c0d\u300c\u6b7b\u4ea1\u3001\u653e\u4e0b\u3001\u548c\u89e3\u3001\u4fee\u88dc\u300d\u7684\u9ad4\u609f\uff0c\u7d55\u5c0d\u6bd4\u6211\u5011\u4e00\u822c\u4eba\u66f4\u591a\uff0c\u900f\u904e\u4e00\u500b\u500b\u7684\u300c\u65c5\u9014\u5982\u4f55\u7d42\u9ede\u300d\u7684\u6545\u4e8b\uff0c\u8b93\u6211\u5011\u6df1\u601d\u751f\u6b7b\u8a71\u984c\u3002 <br /> <br />\u4ed6\u9084\u5e36\u4f86\u4e86\u300c\u4e00\u5361\u76ae\u7bb1\u300d\u88e1\u9762\u88dd\u4e86\u4ed6\u81ea\u5df1\u70ba\u8eab\u5f8c\u6e96\u5099\u7684\u5404\u7a2e\u7269\u4ef6\uff0c\u597d\u597d\u5947\u5594\uff0c\u771f\u7684\u597d\u9f4a\u5168\u8a92\uff0c\u4eba\u6d3b\u8457\u7684\u6642\u5019\u8981\u7528\u5fc3\uff0c\u6b7b\u4ee5\u5f8c\u4e0d\u8981\u8b93\u4eba\u8cbb\u5fc3\uff0c\u5c31\u662f\u5883\u754c\u4e86\u3002 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u5c0f\u51ac\u74dc\u544a\u5225\u5f0f\u60f3\u64ad\u4e94\u6708\u5929\uff1f <br />\u8eab\u70ba\u4e8c\u4ee3\u7684\u75db\u82e6\uff1a\u61f7\u7591\u81ea\u5df1 <br />\u516d\u5bae\u5f37+\u516d\u5bae\u98db\u516d\u5bae\uff1a\u5de5\u4f5c\u72c2\u72c2\u72c2 <br />\u8655\u5973\u5ea7\u7238\u7238\u8868\u9054\u611b&nbsp; <br />\u70ba\u6d3b\u4eba\u8fa6\u7684\u751f\u524d\u544a\u5225\u5f0f <br />\u55ae\u7a0b\u884c\u674e\u7bb1\u88dd\u4ec0\u9ebc <br />\u8001\u5e2b\u6307\u5b9a\u7684\u907a\u7167\u5927\u516c\u958b <br />\u6baf\u846c\u696d\u9069\u5408\u600e\u6a23\u7684\u4eba <br />\u5c0f\u51ac\u74dc\u770b\u5f97\u5230\u9b3c\u55ce <br />-------------- <br />\u5c0f\u51ac\u74dc\u65b0\u66f8\u8cc7\u8a0a <br />\u3010\u751f\u547d\u6700\u5f8c\u4e09\u901a\u96fb\u8a71, \u4f60\u6703\u6253\u7d66\u8ab0?\u3011\u260e\ufe0f <br />\ud83d\udc49https://www.eslite.com/product/10012014082682427816006</p>",
