"description": "<p>\u3010\u5510\u7dba\u967d8/28-9/3\u661f\u5ea7\u904b\u52e2\u9031\u5831\u3011 <br /> <br />\u2605\u5c0d12\u661f\u5ea7\u7684\u5f71\u97ff\uff1a <br /> <br />\u3010\u7d2f\u7684\u3011\u91d1\u725b \u7345\u5b50 \u5929\u79e4 \u5c04\u624b <br /> <br />\u91d1\u725b\uff1a\u5de5\u4f5c\u7a0d\u5b89\u52ff\u8e81\u5225\u653e\u68c4\uff0c\u611f\u60c5\u6709\u843d\u5dee\u8981\u807d\u5c0d\u65b9\u60f3\u6cd5 <br />\u7345\u5b50\uff1a\u5de5\u4f5c\u906d\u9047\u53cd\u8f49\u53ef\u81ea\u6551\uff0c\u611f\u60c5\u7684\u5c0d\u8c61\u5fd9\u5230\u4e0d\u898b\u4eba\u5f71 <br />\u5929\u79e4\uff1a\u6700\u8fd1\u6613\u8ff7\u60d8\u591a\u611b\u81ea\u5df1\u4e00\u9ede\uff0c\u611f\u60c5\u5167\u5916\u7d1b\u4e82\u8981\u591a\u8a55\u4f30 <br />\u5c04\u624b\uff1a\u4e8b\u696d\u7576\u5fc3\u9047\u5230\u7b11\u88e1\u85cf\u5200\uff0c\u611f\u60c5\u8981\u591a\u82b1\u5fc3\u529b\u5225\u7406\u6240\u7576\u7136 <br /> <br />\u3010\u7a69\u7684\u3011\u96d9\u5b50 \u5de8\u87f9 \u5929\u880d \u9b54\u7faf <br /> <br />\u96d9\u5b50\uff1a\u5de5\u4f5c\u9047\u9ad8\u6a19\u8005\u7121\u6cd5\u9b06\u61c8\uff0c\u611f\u60c5\u76f8\u8655\u5225\u592a\u7121\u8da3 <br />\u5de8\u87f9\uff1a\u5de5\u4f5c\u4e0a\u6709\u5927\u7a81\u7834\uff0c\u611f\u60c5\u5225\u592a\u5c08\u5236\u5f37\u52e2 <br />\u5929\u880d\uff1a\u5de5\u4f5c\u9069\u5408\u4f4e\u8abf\u652f\u63f4\uff0c\u611f\u60c5\u652f\u6301\u5c0d\u65b9\u80fd\u53d7\u559c\u611b <br />\u9b54\u7faf\uff1a\u5de5\u4f5c\u80fd\u5c08\u5fc3\u81f4\u5fd7\u7684\u524d\u9032\uff0c\u611f\u60c5\u7a0d\u6709\u5ffd\u7565\u6c92\u9032\u5c55 <br /> <br />\u3010\u8b9a\u7684\u3011\u7261\u7f8a \u8655\u5973 \u6c34\u74f6 \u96d9\u9b5a&nbsp; <br /> <br />\u7261\u7f8a\uff1a\u5de5\u4f5c\u4e0a\u80fd\u5f97\u652f\u63f4\uff0c\u611f\u60c5\u9069\u5408\u5404\u5fd9\u5404\u7684 <br />\u8655\u5973\uff1a\u5de5\u4f5c\u5f37\u9805\u80fd\u597d\u597d\u767c\u63ee\uff0c\u6843\u82b1\u76db\u958b\u611f\u53d7\u5169\u6975 <br />\u6c34\u74f6\uff1a\u5de5\u4f5c\u80fd\u5f97\u8cde\u8b58\u63d0\u62d4\uff0c\u611f\u60c5\u5225\u592a\u9738\u6c23\u4e0d\u807d\u52f8 <br />\u96d9\u9b5a\uff1a\u5de5\u4f5c\u7c3d\u7d04\u9700\u6ce8\u610f\u7d30\u7bc0\uff0c\u611f\u60c5\u8981\u591a\u82b1\u9ede\u5fc3\u601d</p>",
