"description": "<p>\u4f60\u600e\u9ebc\u6368\u5f97\uff5e\u8b93\u6211\u7684\u6dda\u6d41\u5411\u6d77\uff5e\ud83c\udfb5 <br /> <br />\u662f\u4e0d\u662f\u76f4\u63a5\u5531\u8d77\u4f86\u4e86\uff1f\ud83d\ude02\u6c92\u932f\uff0c\u300c\u7407\u7407\u300d\u8a31\u8339\u82b8\u4f86\u4e86\uff01\uff01\uff01\u6dda\u6d77\u662f\u6211\u5230KTV\u5fc5\u5531\u4f46\u5e38\u5531\u4e0d\u4e0a\u53bb\u7684\u6b4c\ud83d\ude16\u4eca\u65e5\u672c\u5c0a\u849e\u81e8\uff0c\u76f4\u63a5\u53eb\u5979\u5531\u7d66\u5927\u5bb6\u807d\u5566~ <br /> <br />\u6211\u8ddf\u7407\u7407\u4e0d\u662f\u5e38\u898b\u9762\uff0c\u4f46\u6bcf\u6b21\u898b\u9762\u5c31\u300c\u4e00\u898b\u5982\u6545\u300d\uff0c\u9084\u76f4\u63a5\u4f60\u4f86\u6211\u5bb6\u3001\u6211\u53bb\u4f60\u5bb6\uff0c\u5403\u98ef\u9ede\u9910\u4e5f\u90fd\u5f88\u5408\u80c3\u53e3\uff5e\uff0c\u70ba\u4ec0\u9ebc\uff1f\u56e0\u70ba\u6211\u5011\u6709\u597d\u591a\uff08\u4e09\u7d44\uff09\u5408\u76f8\u8a92\uff08\u9a5a\u547c\uff09\uff0c\u5176\u4e2d\u4e00\u7d44\u5c31\u662f\u6211\u7684\u592a\u967d\u8207\u5979\u6708\u4eae\u5408\uff0c(\u96e3\u602a\u5979\u8cb7\u7684\u98df\u7269\u6211\u90fd\u89ba\u5f97\u597d\u597d\u5403\ud83e\udd24)(\u4f8b\u5982\u52a0\u9999\u83dc\u7684\u8c46\u82b1\ud83d\ude0d) <br /> <br />\u5979\u8ddf\u97d3\u570b\u5148\u751f\u7684\u7570\u570b\u5341\u5e74\u5a5a\u59fb\u4e5f\u851a\u70ba\u4f73\u8a71\uff0c\u4e00\u76f4\u90fd\u5f88\u53d7\u75bc\u611b\uff0c\u60f3\u77e5\u9053\u600e\u9ebc\u8fa6\u5230\u7684\u55ce\uff1f\uff08\u6211\u81ea\u5df1\u5f88\u60f3xd\uff09\uff0c\u554a\u672c\u96c6\u4e5f\u9806\u4fbf\u662f\u97d3\u570b\u5ab3\u5a66\u6559\u6230\u5b88\u5247\ud83d\ude02\uff08\u4ee5\u53ca\u300c\u96d9\u9b5a\u7537\u653b\u7565\u300d\uff09\uff08\u5979\u8001\u516c\u662f\u96d9\u9b5a\uff09 <br /> <br />\u9084\u6709\u6728\u661f\u4e00\u6a23\u5728\u4e94\u5bae\uff0c\u60f3\u6210\u529f\u627e\u5c0d\u8cb4\u4eba\u7684\u4e00\u5b9a\u8981\u7167\u904e\u4f86\uff0c\u600e\u6a23\u8ddf\u7407\u7407\u4e00\u6a23\u300c\u7b2c\u4e00\u4efd\u5de5\u4f5c\u5c31\u5c0d\u4e86\u300d\uff01\uff01 <br /> <br />\u5148\u8aaa\u9019\u96c6\u5982\u679c\u88ab\u7b11\u8072\u5687\u5230\u7684\u8a71\u4e0d\u662f\u6211\u5594\uff0c\u662f\u8a31\u8339\u82b8\u7684\u7b11\u5594\ud83e\udd23\uff08\u6709\u5920\u5927\u8072\uff09 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u5929\u540e\u4e0a\u53f0\u524d\u9084\u662f\u6703\u7dca\u5f35 <br />\u6728\u661f\u4e94\u5bae\u4e00\u5b9a\u8981\u5148\u6709\u821e\u53f0 <br />\u5341\u4e8c\u5bae\u4eba\u7684\u8ddd\u96e2\u7522\u751f\u7f8e\u611f <br />\u9b54\u7faf\u7684\u6182\u9b31\u662f\u76f4\u63a5\u7626\u7d66\u4f60\u770b <br />\u5531\u6b4c\u5c31\u662f\u5167\u81df\u904b\u52d5 <br />\u5c0d\u5bae\u60c5\u4eba\uff1a\u8655\u5973&amp;\u96d9\u9b5a <br />\u7528\u9152\u7a81\u7834\u96d9\u9b5a\u5fc3\u623f <br />\u6708\u4eae\u5408\u76f8\u5230\u5e95\u6709\u591a\u5408 <br />-------------------- <br />\u8a31\u8339\u82b8 2023\u300a\u9069\u5408\u76f8\u611b\u7684\u6642\u8fb0\u300b\u5de1\u8ff4\u6f14\u5531\u6703 \u53f0\u5317\u7ad9 <br />\u6f14\u51fa\u6642\u9593\uff1a2023 \u5e74 10 \u6708 7 \u65e5 (\u516d)&nbsp;19:30 <br />\u6f14\u51fa\u5730\u9ede\uff1a\u53f0\u5317\u6d41\u884c\u97f3\u6a02\u4e2d\u5fc3 \u8868\u6f14\u5ef3 <br />\u6f14\u51fa\u5730\u5740\uff1a\u53f0\u5317\u5e02\u5357\u6e2f\u5340\u5e02\u6c11\u5927\u9053\u516b\u6bb599\u865f <br />\u7968 \u50f9\uff1aNT$3,680 / $3,280 / $2,680 / $2,080 / $1,680 \u3010\u5168\u5340\u5ea7\u5e2d\u3011 <br /> <br />\u8cfc\u7968\u65b9\u5f0f\uff1aKKTIX\u3001\u5168\u5bb6\u4fbf\u5229\u5546\u5e97 Famiport <br />\u8cfc\u7968\u9023\u7d50\uff1ahttps://kklivetw.kktix.cc/events/valenh2023tourtp</p>",
