"description": "<p>\u672c\u96c6\u63d0\u53ca\uff1a\u516d\u5bae\u98db\u5165\u4e03\u5bae\u5230\u5341\u4e8c\u5bae <br /> <br />\u516d\u5bae\u98db\u661f\u4e0b\u96c6\u4f86\u4e86 <br />\u516d\u5bae\u98db\u661f\u98db\u5230\u54ea\u88e1\uff0c\u5c31\u662f\u4f60\u6709\u6a5f\u6703\u6210\u5c31\u8077\u5834\u3001\u6210\u70ba\u83c1\u82f1\u7684\u9818\u57df\uff0c\u96d6\u7136\u4e00\u958b\u59cb\u5c55\u73fe\u5f97\u50cf\u300c\u88ab\u627e\u9ebb\u7169\u3001\u7121\u6cd5Say no\u3001\u5fc5\u9808\u670d\u52d9\u300d\uff0c\u4f46\u90a3\u4e5f\u662f\u6211\u5011\u767e\u7149\u6210\u92fc\uff0c\u8d8a\u4f86\u8d8a\u53b2\u5bb3\u7684\u539f\u56e0\ud83d\udcaa <br /> <br />\u60f3\u6210\u70ba\u8077\u5834\u83c1\u82f1\uff0c\u7576\u7136\u8981\u770b\u516d\u5bae\u6709\u6c92\u6709\u661f\uff0c\u6c92\u661f\u4e5f\u6c92\u95dc\u4fc2\uff0c\u56e0\u70ba\u53ea\u8981\u627e\u51fa\u516d\u5bae\u5b88\u8b77\u661f\uff0c\u770b\u5b83\u300c\u98db\u5230\u90a3\u88e1\u300d\u5c31\u53ef\u4ee5\u4e86\uff0c\u9019\u5c31\u662f\u516d\u5bae\u98db\u661f\uff0c\u5f88\u7c21\u55ae\u5427\uff1f\u4e0d\u8981\u60f3\u5f97\u592a\u8907\u96dc\uff0c\u4f60\u53ea\u8981\u77e5\u9053\u5b83\u98db\u5230\u54ea\u88e1\u5c31\u53ef\u4ee5\u807d\u4e86\uff0c\u6709\u540c\u5b78\u807d\u5b8c\u604d\u7136\u5927\u609f\uff0c\u89ba\u5f97\u7d42\u65bc\u89e3\u958b\u8eab\u4e16\u4e4b\u8b0e\u4e86\u5462\ud83d\udc4f\ud83d\udc4f\ud83d\udc4f <br /> <br />\u6709\u8208\u8da3\u7684\u540c\u5b78\uff0c\u5c31\u9032\u4f86\u807d\u807d\u5427 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />6\u5bae\u98db7\u5bae\uff1a\u5925\u4f34\u8b93\u4f60\u68d2 <br />8\u5bae\u662f\u5225\u4eba\u7684\u8a55\u50f9 <br />6\u5bae\u98db8\u5bae=\u6253\u4e0d\u6b7b\u7684\u5c0f\u5f37 <br />\u60f3\u7576\u9818\u982d\u7f8a\u76846\u5bae\u98db9\u5bae <br />6\u5bae\u98db10\u5bae\uff1a\u4e00\u5b9a\u8a8d\u771f <br />6\u5bae\u98db11\u5bae\u5f88\u6709\u865f\u53ec\u529b <br />6\u5bae\u98db12\u5bae\u5f88\u6709\u9b25\u5fd7 <br />\u63a5\u89f8\u5230\u7955\u5bc6\u7684\u884c\u696d</p>",
