"description": "<p>\u3010\u5510\u7dba\u967d7/31-8/6\u661f\u5ea7\u904b\u52e2\u9031\u5831\u3011 <br /> <br />\u2605\u5c0d12\u661f\u5ea7\u7684\u5f71\u97ff\uff1a <br /> <br />\u3010\u7d2f\u7684\u3011\u767d\u7f8a \u5de8\u87f9 \u7345\u5b50 \u5929\u79e4 <br /> <br />\u767d\u7f8a\uff1a\u5de5\u4f5c\u4e0a\u8f49\u79fb\u6ce8\u610f\u529b\uff0c\u611f\u60c5\u6843\u82b1\u4e0d\u662f\u5f88\u559c\u6b61 <br />\u5de8\u87f9\uff1a\u5fc3\u60c5\u4f4e\u843d\u5f71\u97ff\u5065\u5eb7\uff0c\u8077\u5834\u591a\u7d1b\u64fe\u7121\u6687\u9867\u6843\u82b1 <br />\u7345\u5b50\uff1a\u5de5\u4f5c\u63a5\u9023\u800c\u4f86\u8981\u4fdd\u91cd\uff0c\u53e6\u4e00\u534a\u7684\u8981\u6c42\u9700\u659f\u914c <br />\u5929\u79e4\uff1a\u8077\u5834\u4e0a\u7121\u6cd5\u7ad9\u968a\u597d\u5c37\u5c2c\uff0c\u611f\u60c5\u4e0a\u4e5f\u7121\u5fc3\u4eab\u53d7 <br /> <br />\u3010\u7a69\u7684\u3011\u96d9\u5b50 \u5c04\u624b \u9b54\u7faf \u6c34\u74f6 <br /> <br />\u96d9\u5b50\uff1a\u5de5\u4f5c\u7a0d\u5b89\u52ff\u8e81\u807d\u5225\u4eba\u610f\u898b\uff0c\u611f\u60c5\u554f\u984c\u4f86\u81ea\u4e0d\u5b89\u5168\u611f <br />\u5c04\u624b\uff1a\u5de5\u4f5c\u4e0a\u6709\u9078\u64c7\u56f0\u96e3\uff0c\u611f\u60c5\u8981\u6162\u6162\u6478\u7d22 <br />\u9b54\u7faf\uff1a\u5de5\u4f5c\u5225\u592a\u62d8\u8b39\u3001\u53ef\u5927\u81bd\u4e9b\uff0c\u591a\u9ede\u7b11\u5bb9\u6843\u82b1\u66f4\u65fa <br />\u6c34\u74f6\uff1a\u5de5\u4f5c\u4e0a\u6709\u7280\u5229\u5973\u8cb4\u4eba\uff0c\u611f\u60c5\u4e0a\u6c34\u74f6\u5973\u5225\u592a\u5f37\u52e2 <br /> <br />\u3010\u8b9a\u7684\u3011\u91d1\u725b \u8655\u5973 \u5929\u880d \u96d9\u9b5a <br /> <br />\u91d1\u725b\uff1a\u5468\u906d\u8cb4\u4eba\u591a\uff0c\u6709\u8af8\u591a\u652f\u6301\u8207\u5584\u610f <br />\u8655\u5973\uff1a\u8ca1\u904b\u4f73\u3001\u751f\u6d3b\u54c1\u8cea\u63d0\u9ad8\uff0c\u611f\u60c5\u6392\u5728\u5de5\u4f5c\u5f8c <br />\u5929\u880d\uff1a\u64ec\u5b9a\u76ee\u6a19\u8e8d\u8e8d\u6b32\u8a66\uff0c\u611f\u60c5\u53ea\u597d\u5148\u653e\u8457 <br />\u96d9\u9b5a\uff1a\u5de5\u4f5c\u7d50\u6848\u9b06\u4e86\u53e3\u6c23\uff0c\u611f\u60c5\u9700\u8981\u4e92\u52a9\u7684\u968a\u53cb</p>",
