"description": "<p>\u3010\u5510\u7dba\u967d7/24-7/30\u661f\u5ea7\u904b\u52e2\u9031\u5831\u3011 <br /> <br />\u2605\u5c0d12\u661f\u5ea7\u7684\u5f71\u97ff\uff1a <br /> <br />\u3010\u7d2f\u7684\u3011\u91d1\u725b \u96d9\u5b50 \u5c04\u624b \u6c34\u74f6 <br /> <br />\u91d1\u725b\uff1a\u5de5\u4f5c\u4e0a\u9700\u8981\u53b2\u5bb3\u5e6b\u624b\uff0c\u611f\u60c5\u8981\u6e9d\u901a\u91d1\u9322\u89c0\u5ff5 <br />\u96d9\u5b50\uff1a\u5fd9\u788c\u4e4b\u9918\u4e5f\u8981\u6ce8\u610f\u5468\u906d\uff0c\u611f\u60c5\u7576\u5fc3\u56e0\u5de5\u4f5c\u800c\u722d\u57f7 <br />\u5c04\u624b\uff1a\u5de5\u4f5c\u4e0a\u5176\u5be6\u5e6b\u624b\u5f88\u591a\uff0c\u611f\u60c5\u6ce8\u610f\u5225\u592a\u535a\u611b <br />\u6c34\u74f6\uff1a\u5de5\u4f5c\u5225\u5fd9\u5230\u5fd8\u8a18\u539f\u5b9a\u76ee\u6a19\uff0c\u611f\u60c5\u4e0a\u8981\u8a18\u5f97\u8e10\u8afe <br /> <br />\u3010\u7a69\u7684\u3011\u5de8\u87f9 \u7345\u5b50 \u8655\u5973 \u5929\u79e4 <br /> <br />\u5de8\u87f9\uff1a\u5de5\u4f5c\u6709\u5347\u5b98\u904b\uff0c\u611f\u60c5\u6709\u5371\u6a5f\u624d\u6703\u7a4d\u6975 <br />\u7345\u5b50\uff1a\u5de5\u4f5c\u4e0a\u62ff\u51fa\u4e3b\u898b\u5427\uff0c\u611f\u60c5\u4e0a\u5225\u592a\u5f37\u52e2 <br />\u8655\u5973\uff1a\u9031\u516d\u524d\u8acb\u7a0d\u5b89\u52ff\u8e81\uff0c\u611f\u60c5\u53ef\u653e\u5fc3\u7b49\u5f85 <br />\u5929\u79e4\uff1a\u505a\u8a72\u505a\u7684\u4e8b\u4e0d\u88ab\u6643\u52d5\uff0c\u611f\u60c5\u4e0a\u62d2\u7d55\u6cb9\u5634\u6ed1\u820c\u985e\u578b <br /> <br />\u3010\u8b9a\u7684\u3011\u7261\u7f8a \u5929\u880d \u9b54\u7faf \u96d9\u9b5a <br /> <br />\u7261\u7f8a\uff1a\u4eba\u969b\u95dc\u4fc2\u6d3b\u8e8d\u6109\u5feb\uff0c\u611f\u60c5\u6709\u6a5f\u6703\u59d0\u5f1f\u6200 <br />\u5929\u880d\uff1a\u5de5\u4f5c\u4e0a\u9577\u8f29\u524d\u8f29\u662f\u8cb4\u4eba\uff0c\u611f\u60c5\u6703\u60f3\u6a5f\u667a\u4e00\u9ede <br />\u9b54\u7faf\uff1a\u8207\u4eba\u751f\u52dd\u5229\u7d44\u9023\u7d50\uff0c\u611f\u60c5\u6709\u597d\u6843\u82b1\u51fa\u73fe <br />\u96d9\u9b5a\uff1a\u80fd\u597d\u597d\u4f4e\u8abf\u4f11\u606f\uff0c\u611f\u60c5\u80fd\u5fc3\u60f3\u4e8b\u6210</p>",
