"description": "<p>\u300c\u5225\u900f\u904e\u5225\u4eba\u53cd\u61c9\u4f86\u7d50\u7b97\u81ea\u5df1\u7684\u4eba\u751f\u300d\u3001\u300c\u5275\u50b7\u5f88\u96e3\u88ab\u9006\u8f49\uff0c\u4f46\u6211\u5011\u80fd\u91cd\u65b0\u5b9a\u7fa9\u5275\u50b7\u300d <br /> <br />\u6211\u5fc3\u76ee\u4e2d\u6700\u6709\u667a\u6167\u7684\u5973\u6027\uff0c\u9127\u60e0\u6587\u91ab\u5e2b\u4f86\u4e86\uff01\uff01\uff01(\u91d1\u661f\u505c\u6eef\u7345\u5b50\uff0c\u7345\u5b50\u5ea7\u7684\u6545\u53cb\u5c31\u4f86\u4e86) <br />\u6700\u611b\u807d\u9127\u91ab\u5e2b\u8b1b\u8a71\uff0c\u4ec0\u9ebc\u5929\u5927\u7684\u554f\u984c\uff0c\u6211\u5728\u76ba\u7709\u60f3\u4e0d\u901a\u6642\uff0c\u5979\u5df2\u4e00\u91dd\u898b\u8840\u3001\u91d1\u53e5\u983b\u767c\u4e86\uff0c\u7e3d\u8b93\u6211\u6709\u918d\u9190\u704c\u9802\u7684\u611f\u53d7\uff0c\u9019\u6b21\u5979\u4f86\u6211\u7684Podcast\uff0c\u4f86\u5834\u6df1\u5c64\u5c0d\u8a71\uff0c\u4e26\u91cd\u65b0\u5b9a\u7fa9\u4f55\u8b02\u300c\u81ea\u6211\u89ba\u5bdf\u300d\uff0c\u4f86\u5f97\u6b63\u662f\u9700\u8981\u3002 <br /> <br />\u5982\u679c\u4f60\u4e5f\u5c0d\u81ea\u6211\u6709\u6240\u5fac\u5fa8\u3001\u627e\u4e0d\u5230\u65b9\u5411\uff0c\u5c31\u4f86\u807d\u807d\u9019\u96c6\u7642\u7652\u4e00\u4e0b\u5427\uff0c\u8a8d\u8b58\u81ea\u5df1\u4e26\u4e0d\u5bb9\u6613\uff0c\u4f46\u6211\u76f8\u4fe1\uff0c\u6211\u5011\u5df2\u7d93\u5728\u8def\u4e0a\u4e86\u2764\ufe0f <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u66fe\u7d93\u5922\u60f3\u7576\u5fc3\u7406\u5e2b\u7684\u5510\u8001\u5e2b <br />\u8a8d\u9818\u81ea\u5df1\u7684\u751f\u6d3b <br />\u4e0a\u5347\u7345\u5b50\u76f8\u4fe1\u9760\u52aa\u529b\u5f97\u4f86\u7684\u6771\u897f <br />\u81ea\u6211\u89ba\u5bdf\u8ab2\u7a0b\uff1a\u4f60\u4e86\u89e3\u4f60\u81ea\u5df1\u55ce\uff1f <br />\u8a2d\u754c\u7dda\u7684\u8a23\u7ac5 <br />\u8dd1\u53bb\u5c71\u88e1\u554f\u5a46\u5a46\u611b\u60c5\u2026 <br />\u80c3\u53e3\u8b8a\u5c0f\u7684\u5510\u8001\u5e2b(?) <br /> <br />-------------- <br />\u3010\u9127\u60e0\u6587\u7684\u81ea\u6211\u89ba\u5bdf\u5fc5\u4fee\u8ab2\u3011 <br />10\u5802\u8ab2\uff0c\u5e36\u4f60\u4e86\u89e3\u4eba\u751f\u56db\u5927\u8b70\u984c\uff0c\u6210\u70ba\u60c5\u7dd2\u81ea\u4e3b\u7684\u5927\u4eba <br /><a href=\"https://www.facebook.com/hashtag/%E8%87%AA%E6%88%91?__eep__=6&amp;__cft__[0]=AZX63So5ZNjp8WrRIJZNGkN1v3PUzXwkieztODAiTm-vpMMw-Dk4MR4xOgLOq0Sdwvw8Y_QgcHwTP4isK4fL2meEcOrgAeuPwTM6UohVAqjJC_VTwPJUgGkqWWtEnopImRg&amp;__tn__=*NK-R\" target=\"_blank\">#\u81ea\u6211</a> <a href=\"https://www.facebook.com/hashtag/%E8%A6%AA%E5%AF%86?__eep__=6&amp;__cft__[0]=AZX63So5ZNjp8WrRIJZNGkN1v3PUzXwkieztODAiTm-vpMMw-Dk4MR4xOgLOq0Sdwvw8Y_QgcHwTP4isK4fL2meEcOrgAeuPwTM6UohVAqjJC_VTwPJUgGkqWWtEnopImRg&amp;__tn__=*NK-R\" target=\"_blank\">#\u89aa\u5bc6</a> <a href=\"https://www.facebook.com/hashtag/%E5%AE%B6%E5%BA%AD?__eep__=6&amp;__cft__[0]=AZX63So5ZNjp8WrRIJZNGkN1v3PUzXwkieztODAiTm-vpMMw-Dk4MR4xOgLOq0Sdwvw8Y_QgcHwTP4isK4fL2meEcOrgAeuPwTM6UohVAqjJC_VTwPJUgGkqWWtEnopImRg&amp;__tn__=*NK-R\" target=\"_blank\">#\u5bb6\u5ead</a> <a href=\"https://www.facebook.com/hashtag/%E7%A4%BE%E6%9C%83?__eep__=6&amp;__cft__[0]=AZX63So5ZNjp8WrRIJZNGkN1v3PUzXwkieztODAiTm-vpMMw-Dk4MR4xOgLOq0Sdwvw8Y_QgcHwTP4isK4fL2meEcOrgAeuPwTM6UohVAqjJC_VTwPJUgGkqWWtEnopImRg&amp;__tn__=*NK-R\" target=\"_blank\">#\u793e\u6703</a> <br /> <br />\u25aa\ufe0e\u4e86\u89e3\u81ea\u5df1\u7684\u50f9\u503c\u89c0\u3001\u60c5\u611f\u8207\u884c\u70ba\u6a21\u5f0f <br />\u25aa\ufe0e\u7167\u9867\u81ea\u5df1\u7684\u60c5\u7dd2\u8207\u611f\u53d7\uff0c\u6e1b\u8f15\u58d3\u529b\u548c\u7126\u616e <br />\u25aa\ufe0e\u767c\u6398\u81ea\u5df1\u7684\u6f5b\u80fd\uff0c\u627e\u5230\u8208\u8da3\u8207\u4eba\u751f\u50f9\u503c <br /> <br />\u8271\u6f80\u96e3\u61c2\u7684\u5fc3\u7406\u5b78\u77e5\u8b58out\uff01\u770b\u4f3c\u7c21\u55ae\u537b\u6709\u5927\u5927\u5a01\u529b\uff01 <br />\u966a\u4f60\u5ea6\u904e\u6bcf\u500b\u60c5\u7dd2\u4f4e\u8c37\uff0c\u6d3b\u51fa\u81ea\u5df1\u7684\u4eba\u751f\uff01 <br /> <br /><a href=\"https://www.facebook.com/hashtag/%E8%AA%B2%E7%A8%8B%E5%84%AA%E6%83%A0?__eep__=6&amp;__cft__[0]=AZX63So5ZNjp8WrRIJZNGkN1v3PUzXwkieztODAiTm-vpMMw-Dk4MR4xOgLOq0Sdwvw8Y_QgcHwTP4isK4fL2meEcOrgAeuPwTM6UohVAqjJC_VTwPJUgGkqWWtEnopImRg&amp;__tn__=*NK-R\" target=\"_blank\">#\u8ab2\u7a0b\u512a\u60e0</a> <br />7/27\u524d\u4eab\u8ab2\u7a0b\u65e9\u9ce5\u512a\u60e0\uff0c\u8d8a\u65e9\u5165\u624b\u8d8a\u5212\u7b97\uff01 <br />\u8f38\u5165\u3010TYG0727\u3011\u518d\u4eab\u807d\u53cb\u5c08\u5c6c\u6298\u6263\uff1a <br /><a href=\"https://cplink.co/mpQ9fsIK?fbclid=IwAR31PgHJZXY9mWc9uNMig1it9NBGyS1zJ9-zBzMwacKdsNtnDmx_MUyoW58\" target=\"_blank\">https://cplink.co/mpQ9fsIK</a></p>",
