"description": "<p>\u7576\u5929\u4e0a\u6709\u661f\u9006\u884c\uff0c\u4e0d\u7ba1\u6c34\u9006\u3001\u571f\u9006\u3001\u9084\u662f\u6728\u9006\u6d77\u9006\uff0c\u5c31\u6703\u89ba\u5f97\u80fd\u91cf\u6709\u5361\u3001\u4e0d\u592a\u9806\u66a2 <br />\u90a3\uff0c\u300c\u661f\u76e4\u4e2d\u6709\u661f\u9006\u884c\u300d\u5462\uff1f\u672c\u547d\u6709\u9006\u884c\u661f\uff0c\u5c31\u770b\u5230\u540c\u5b78\u554f\uff1a\u5929\u751f\u6c34\u9006\u5c31\u6703\u5012\u6963\u55ce\uff1f\u91d1\u9006\u6703\u82e6\u6200\u55ce\uff1f\u571f\u9006\u6703\u82e6\u5f97\u6709\u5920\u4e45\u55ce\uff1f\u8a92\uff0c\u4f60\u5011\u7684\u554f\u984c\u6211\u807d\u5230\u4e86\uff0c\u611f\u89ba\u771f\u7684\u8a72\u597d\u597d\u505a\u4e00\u96c6 <br /> <br />\u5982\u679c\u4e0d\u4fe1\uff0c\u8acb\u628a\u8eab\u908a\u300c\u611f\u89ba\u904b\u6c23\u5f88\u597d\u300d\u7684\u670b\u53cb\u661f\u76e4\u6253\u958b\u4f86\u77a7\u77a7\uff0c\u6709\u9006\u884c\u661f\u7684\u300c\u9435\u5b9a\u4f54\u5927\u591a\u6578\u300d\uff5e\u6240\u4ee5\u7232\u4ec0\u9ebc\u5462\uff1f\uff08\u5f88\u96e3\u60f3\u50cf\u543c\uff1f\uff09 <br />\u661f\u76e4\u6709\u661f\u9006\u884c\u6709\u4f55\u5f71\u97ff\uff1f\u9006\u884c\u7684\u300c\u5e78\u904b\u6cd5\u5247\u300d\u53c8\u662f\u4ec0\u9ebc\uff1f\u9006\u884c\u4ec0\u9ebc\u90fd\u4e45\u4e5f\u5305\u62ec\u6210\u529f\u55ce\uff1f\u82e6\u7684\u5730\u65b9\u53c8\u5728\u54ea\u88e1\u5462\uff1f \u9019\u96c6\u6211\u90fd\u6703\u8b1b\u5230\u5594\uff0c\u6eff\u6eff\u9006\u884c\u61f6\u4eba\u5305\u6709\u8208\u8da3\u7684\u540c\u5b78\u4f86\u807d\u807d\u5427\uff01 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u5bb9\u6613\u756b\u932f\u91cd\u9ede\u7684\u6c34\u9006\u4eba <br />\u6c34\u9006\u4eba\u662f\u6e96\u5099\u578b\u9078\u624b <br />\u7f8e\u5f97\u5f88\u7279\u5225\u7684\u91d1\u9006\u4eba <br />\u91d1\u9006\u4eba\uff0c\u4e0d\u611b\u8d70\u5225\u4eba\u92ea\u597d\u7684\u8def <br />\u5167\u5efa\u715e\u8eca\u7cfb\u7d71\u7684\u706b\u9006\u4eba <br />\u706b\u9006\u4eba\u597d\u6027\u611f <br />\u5f88\u96e3\u4fe1\u4efb\u4eba\u7684\u6728\u9006\u4eba <br />\u6728\u9006\u4eba\u7684\u5e78\u904b\u6cd5\u5247 <br />\u751f\u4f86\u625b\u8cac\u7684\u571f\u9006\u4eba <br />\u571f\u9006\u4eba\u5f88\u96e3\u9000\u4f11 <br />\u7121\u661f\u9006\u884c\u5929\u771f\u53c8\u5feb\u6a02(?)</p>",
