"description": "<p>\u3010\u5510\u7dba\u967d5/29-6/4\u661f\u5ea7\u904b\u52e2\u9031\u5831\u3011 <br /> <br />\u3010\u7d2f\u7684\u3011\u5929\u79e4 \u5929\u880d \u6c34\u74f6 \u96d9\u9b5a <br />\u5929\u79e4\uff1a\u5de5\u4f5c\u4e0a\u70ba\u7f3a\u5931\u5584\u5f8c\uff0c\u611f\u60c5\u4e0a\u8981\u591a\u64d4\u5f85\u5c0d\u65b9\u5fc3\u60c5 <br />\u5929\u880d\uff1a\u5fc3\u88e1\u4e0d\u5e73\u8861\u8981\u8abf\u9069\uff0c\u611f\u60c5\u5225\u53ea\u95dc\u6ce8\u5c0d\u65b9\u7f3a\u9ede <br />\u6c34\u74f6\uff1a\u5de5\u4f5c\u4e0a\u8981\u4e3b\u52d5\u7a4d\u6975\uff0c\u611f\u60c5\u88e1\u5225\u592a\u88ab\u52d5 <br />\u96d9\u9b5a\uff1a\u5de5\u4f5c\u4e0a\u8981\u7a0d\u5b89\u52ff\u8e81\uff0c\u611f\u60c5\u88e1\u6709\u9ede\u9003\u907f\u50be\u5411 <br /> <br />\u3010\u7a69\u7684\u3011\u7261\u7f8a \u91d1\u725b \u96d9\u5b50 \u5de8\u87f9 <br />\u7261\u7f8a\uff1a\u591a\u6ce8\u610f\u91d1\u9322\u8d70\u5411\uff0c\u611f\u60c5\u4e0a\u89c0\u5ff5\u4e0d\u540c\u5148\u85cf\u4e00\u4e0b <br />\u91d1\u725b\uff1a\u5de5\u4f5c\u4e0a\u6709\u9577\u8f29\u7de3\u4f46\u53d7\u727d\u5236\uff0c\u611f\u60c5\u4e0a\u53ef\u8acb\u5927\u4eba\u505a\u4e3b <br />\u96d9\u5b50\uff1a\u6709\u6d77\u5916\u3001\u7570\u570b\u6a5f\u904b\uff0c\u611f\u60c5\u4e0a\u5c0f\u5225\u52dd\u65b0\u5a5a <br />\u5de8\u87f9\uff1a\u5de5\u4f5c\u4e0a\u70ba\u66f4\u597d\u800c\u6295\u8cc7\uff0c\u611f\u60c5\u9069\u5408\u5403\u559d\u73a9\u6a02 <br /> <br />\u3010\u8b9a\u7684\u3011\u7345\u5b50 \u8655\u5973 \u5c04\u624b \u9b54\u7faf <br />\u7345\u5b50\uff1a\u53ef\u53c3\u8003\u5e74\u8f15\u4eba\u7684\u610f\u898b\uff0c\u4e3b\u52d5\u7a4d\u6975\u8b93\u6843\u82b1\u66f4\u65fa <br />\u8655\u5973\uff1a\u5de5\u4f5c\u4e0a\u4eba\u8108\u5f88\u91cd\u8981\uff0c\u611f\u60c5\u7684\u6843\u82b1\u7d1b\u98db\u8981\u614e\u9078 <br />\u5c04\u624b\uff1a\u81ea\u7531\u653e\u9b06\u66f4\u986f\u7279\u5225\uff0c\u8ac7\u6200\u611b\u5225\u592a\u7cbe\u660e <br />\u9b54\u7faf\uff1a\u5de5\u4f5c\u5be6\u529b\u5f37\uff0c\u5225\u81ea\u6211\u8a2d\u9650\uff0c\u611f\u60c5\u4e0a\u5225\u592a\u7121\u8da3</p>",
