"description": "<p>\u672c\u96c6\u63d0\u5230: \u6708\u4eae\u6c34\u8c61\u3001\u6708\u4eae\u706b\u8c61 <br /> <br />\u5927\u5bb6\u559c\u6b61\u7684\u300c\u6708\u4eae\u661f\u5ea7\u300d\u53c8\u4f86\u4e86\uff5e <br />\u6708\u4eae\u661f\u5ea7\u4e5f\u53ef\u4ee5\u770b\u300c\u4f60\u6709\u54ea\u4e00\u6b3e\u5abd\u5abd\u300d\uff0c\u6216\u300c\u770b\u5230\u5abd\u5abd\u7684\u54ea\u4e00\u9762\u300d\uff0c\u6bcd\u89aa\u7bc0\u5c07\u81f3\uff0c\u4e0d\u8ad6\u611b\u6068\u90fd\u4f86\u807d\u807d\u4f60\u7684\u6708\u4eae\u600e\u9ebc\u8aaa <br /> <br />\u7136\u5f8c\u884d\u4f38\u984c\u5c31\u4f86\u4e86\uff0c\u5e7e\u500b\u5144\u5f1f\u59d0\u59b9\u6708\u4eae\u4e0d\u540c\uff0c\u4f46\u90fd\u662f\u540c\u4e00\u500b\u5abd\u5abd\u751f\u7684\uff0c\u90a3\uff0c\u9ede\u89e3\uff1f <br />\u9019\u96c6\u6709\u5fb5\u7a3f\uff0c\u5927\u5bb6\u7684\u6545\u4e8b\u90fd\u597d\u7cbe\u5f69\ud83d\ude33\uff0c\u4e00\u8d77\u4f86\u5171\u9cf4\u4e00\u4e0b\uff5e\u4f86\u807d\u9019\u4e00\u96c6\u5427\uff01 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u7167\u9867\u4f60\u7684\u4eba\u90fd\u53ef\u770b <br />\u6708\u5de8\u87f9\u7684\u5abd\uff0c\u662f\u6a19\u6e96\u5abd\u5abd <br />\u6708\u5929\u880d\u7684\u5abd\u5abd\u597d\u6027\u611f <br />\u60f3\u5feb\u9577\u5927\u4fdd\u8b77\u5abd\u7684\u6708\u96d9\u9b5a <br />\u6708\u7261\u7f8a\u773c\u4e2d\uff0c\u4e0d\u662f\u5abd\u662f\u540c\u5b78 <br />\u8ddf\u4f60\u6bd4\u7f8e\uff0c\u6708\u7345\u5b50\u7684\u5abd <br />\u6708\u5c04\u624b\u7684\u5abd\uff0c\u6700\u4e0d\u50cf\u5abd\uff1f <br /> <br />------------------------- <br />\u672c\u96c6\u611f\u8b1d\u3010\u53f0\u7063\u62dc\u8033\u529b\u5ea6\u4f38\u3011\u8d0a\u52a9\u64ad\u51fa <br /> <br />\u529b\u5ea6\u4f38C+D+\u92c5 \u9ed1\u918b\u6817\u53e3\u5473\u79ae\u76d2\u7d44 <br />\u6bcd\u89aa\u7bc0\u671f\u9593\u9650\u5b9a \u9644\u4e0a\u300c\u7389\u77f3\u6efe\u8f2a+\u522e\u75e7\u677f\u300d <br />\u7f8e\u9e97\u5065\u5eb7\u5167\u5916\u517c\u9867 <br />\u2728\u5510\u8001\u5e2b\u7279\u5225\u722d\u53d6\u9650\u6642\u512a\u60e0\u2728 <br />\u625347\u6298 \u53ea\u8981$1116(\u539f\u50f9$2340) <br />\u6d3b\u52d5\u6642\u9593\uff1a5/10-5/16 <br />\u25b6https://reurl.cc/8qME5o <br />&nbsp; <br />\u5176\u4ed6\u512a\u60e0\u6d3b\u52d5 <br />\u2728\u6eff\u984d\u6298 <br />\u6eff1599\u6298160\uff0c\u6eff2299\u6298280 <br />\u2728\u6eff\u984d\u8d08 <br />\u6eff999\u8d087-11\u79ae\u5238$100 x1\uff0c\u6eff1399\u8d08\u661f\u5df4\u514b\u514c\u63db\u5238x1 <br />&nbsp; <br />\u63d0\u9192\u60a8\uff1a\u672c\u7db2\u7ad9\u4e26\u975e\u63d0\u4f9b\u6c11\u773e\u901a\u5831\u526f\u4f5c\u7528\u7684\u7ba1\u9053\uff0c\u5982\u679c\u60a8\u61f7\u7591\u6709\u526f\u4f5c\u7528\u800c\u9700\u8981\u5354\u52a9\uff0c\u8acb\u60a8\u76e1\u901f\u9023\u7d61\u60a8\u7684\u4e3b\u6cbb\u91ab\u5e2b\u6216\u85e5\u5e2b\uff0c\u4ee5\u53d6\u5f97\u9069\u7576\u7684\u91ab\u7642\u5354\u52a9\u3002 <br />\u82e5\u60a8\u9700\u8981\u5411\u62dc\u8033\u901a\u5831\u85e5\u7269\u4e0d\u826f\u4e8b\u4ef6\u7b49\u5b89\u5168\u8cc7\u8a0a\uff0c\u8acb\u4ee5\u96fb\u5b50\u90f5\u4ef6\u65b9\u5f0f\u5bc4\u5230: drugsafety.taiwan@bayer.com \u6216\u76f4\u63a5\u9023\u4e0a https://safetrack-public.bayer.com \u901a\u5831\u81f3\u672c\u516c\u53f8 <br />\u5167\u5be9\u5b57\u865f: CH-20230428-32</p>",
