"description": "<p>\u53e4\u4eba\u7cfb\u5217\u6c92\u60f3\u5230\u771f\u7684\u6709\u4eba\u9858\u610f\u4f86\u311f\u54c8\u54c8\u54c8\uff0c\u6b61\u8fce\u6700\u6703\u8aaa\u6545\u4e8b\u7684\u6b50\u5409\u6851\u2013\u5433\u5ff5\u771f\uff01 <br />\u770b\u4ed6\u5c31\u77e5\u9053\uff0c\u7345\u5b50\u7537\u5c31\u7b9770\u6b72\u4e5f\u8ddf\u5e74\u8f15\u4eba\u4e00\u6a23\u4e0d\u670d\u8f38\uff0c\u4e00\u6a23\u5931\u63a7\uff0c\u91ab\u751f\u7684\u8a71\u6c92\u5728\u807d\uff0c\u628a\u81ea\u5df1\u7576\u666e\u901a\u4eba\u7d93\u71df\uff0c\u679c\u7136\u5931\u63a7\ud83e\udd23 <br />\u597d\u5566\uff0c\u9304\u5b8c\u9019\u96c6\uff0c\u4e0a\u5347\u7345\u5b50\u7684\u6211\u6c7a\u5b9a\uff0c\u8981\u8ddf\u5ff5\u771f\u5927\u54e5\u4e00\u6a23\uff0c\u4e00\u8d77\u7576\u4e0d\u8001\u5927\u4eba\uff5e <br />\u4f86\u807d\u807d\u300c\u6587\u7ae0\u6709\u6536\u9304\u5728\u5c0f\u5b78\u8ab2\u672c\u7684\u5c11\u6578\u6d3b\u4eba\u300d\u5ff5\u771f\u5927\u54e5\u7684\u5931\u63a7\u5c08\u8f2f\uff01 <br /> <br />ps.\u672c\u96c6\u5ff5\u771f\u5927\u54e5\u81ea\u5632\u6280\u80fd\u958b\u6eff\u9ede\uff0c\u8b9a\u3002 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u6703\u8a08\u5ff5\u7684\u4e0d\u932f\u4f46\u5c0d\u5beb\u5287\u672c\u6c92\u5e6b\u52a9 <br />\u5f9e\u5beb\u5c0f\u8aaa\u5230\u821e\u53f0\u5287 <br />\u6253\u6b7b\u4e0d\u5403\u5730\u74dc\u8449\u7684\u5433\u5ff5\u771f <br />\u5f9e\u5433\u5ff5\u771f\u8eab\u4e0a\u770b\u52309\u5bae\u7d50\u540811\u5bae <br />\u4ee3\u8a00\u592a\u591a\uff0c\u807d\u5230\u81ea\u5df1\u7684\u8072\u97f3\u5c31\u8f49\u53f0 <br />\u8eab\u9ad4\u767c\u80b2\u5f97\u665a\uff0c\u8166\u7b4b\u767c\u80b2\u5f97\u65e9 <br />\u6bcf\u5929\u90fd\u5f88\u9913\u7684\u5c0f\u6642\u5019 <br />\u5433\u5ff5\u771f\u770b\u5230\u72d7\u5c31\u60f3\u6eba\u611b\u4ed6 <br />\u88ab\u62dc\u8a17\u5c31\u6703\u505a\u7684\u7345\u5b50\u5ea7 <br />\u7acb\u5fd7\u7576\u500b\u4e0d\u6eba\u611b\u7684\u963f\u516c\uff08\u4e0d.\u53ef.\u80fd\uff09 <br />------------------ <br />\u300a\u6e05\u660e\u6642\u7bc0\u300b2023\u6607\u83ef\u7248 <br />\u6539\u7de8\u81ea\u570b\u5bb6\u6587\u85dd\u734e\u5f97\u4e3b \u912d\u6e05\u6587 \u539f\u8457\u5c0f\u8aaa <br />\u5c0e\u6f14\u5433\u5ff5\u771f \u7562\u751f\u6700\u937e\u611b\u5287\u672c <br />\ud83d\udc49 https://gdn.tw/lightmoments <br />\u2061 <br />\ud83d\udd25\u6f14\u51fa\u5834\u6b21\ud83d\udd25&nbsp; <br />\ud83d\udccc 6/23-6/25 \u9ad8\u96c4\u885b\u6b66\u71df\u570b\u5bb6\u6b4c\u5287\u9662 <br />\ud83d\udccc 6/30-7/2 \u81fa\u4e2d\u570b\u5bb6\u6b4c\u5287\u9662\u5927\u5287\u9662 <br />\ud83d\udccc 9/1-9/3\uff1b9/8- 9/10 \u53f0\u5317\u570b\u5bb6\u6232\u5287\u9662</p>",
