"description": "<p>\u5bb9\u6613\u88ab\u98a8\u8c61\u661f\u5ea7\u5438\u5f15\uff1f\u6216\u4f60\u7684\u53e6\u4e00\u534a\u5c31\u662f\u98a8\u8c61\u661f\u5ea7\uff1f <br />\u90a3\u4f60\u4e00\u5b9a\u662f\u500b\u5fc3\u5fd7\u5f37\u5927\u3001\u7368\u7acb\u81ea\u4e3b\u7684\u4eba <br />\u56e0\u70ba\u2026\u8ddf\u98a8\u8c61\u661f\u5ea7\u8ac7\u6200\u611b\uff0c\u5c31\u662f\u4e00\u6bb5\u5b78\u6703\u611b\u81ea\u5df1\u7684\u904e\u7a0b\u554a\ud83d\udeac\uff08\u8b0e\u4e4b\u97f3\uff1a\u6216\u7fd2\u6163\u55ae\u8eab\u7684\u904e\u7a0b\ud83d\ude02\uff09 <br />\u4eca\u5929\u5c31\u4f86\u597d\u597d\u804a\u4e00\u4e0b\uff0c\u5982\u4f55\u8ddf\u9019\u4e9b\u8b93\u4eba\u5fc3\u75db\u7684\u98a8\u8c61\u7537\u5b50\u5011\u8ac7\u6200\u611b\u5427\uff01\u56e0\u70ba\u6642\u9577\u95dc\u4fc2&nbsp;, \u9019\u7cfb\u5217\u7b2c\u4e00\u96c6\u6703\u8b1b\u98a8\u8c61\u548c\u591a\u8b1b\u4e00\u4e9b\u6c34\u74f6\u5ea7\u653b\u7565 , \u60f3\u807d\u5176\u4ed6\u661f\u5ea7\u7684 ,\u8acb\u6572\u7897\u5594&nbsp; <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u8b93\u4eba\u5fc3\u75db\u7684\u98a8\u8c61\u7537\u5b50 <br />\u5f97\u5931\u5fc3\u592a\u91cd\u7684\u52ff\u9760\u8fd1\u98a8\u8c61 <br />\u98a8\u8c61\u6c92\u8b8a\uff0c\u8b8a\u7684\u662f\u4f60 <br />\u6c34\u74f6\u7537\u662f\u62fc\u5716 <br />\u4f60\u96c6\u6eff\u6c34\u74f6\u7537\u62fc\u5716\u4e86\u55ce <br />\u6c34\u74f6\u7537\u6709\u559c\u6b61\u4f60\u55ce\uff1f \u8acb\u591a\u89c0\u5bdf <br />---------------------- <br />\u62dc\u7dad\u4f73 \u559d\u7684\u884c\u52d5\u96fb\u6e90\uff0c\u6642\u523b\u8292\u4e2d\u6709\u52c1POWER ON\ud83d\udcaa <br />\u2714\ufe0f\u7dad\u751f\u7d20B1/B2\u5e6b\u52a9\u7dad\u6301\u80fd\u91cf\u6b63\u5e38\u4ee3\u8b1d\uff0c\u7cbe\u795e\u65fa\u76db\uff0c\u589e\u5f37\u9ad4\u529b <br />\u2714\ufe0f\u7dad\u751f\u7d20B6/B12\u7dad\u6301\u795e\u7d93\u7cfb\u7d71\u5065\u5eb7 <br />\u2714\ufe0f\u7dad\u751f\u7d20C\u7d55\u4f73\u7684\u6297\u6c27\u5316\u5291 <br />\u2714\ufe0f\u9223\u6709\u52a9\u65bc\u7dad\u6301\u9aa8\u9abc\u8207\u7259\u9f52\u7684\u6b63\u5e38\u767c\u80b2\u53ca\u5065\u5eb7 <br />&nbsp; <br />\u6bcf\u5929\u900f\u904e\u4e00\u5c0f\u9320\u62dc\u7dad\u4f73\u642d\u914d200-300 cc\u51b7\u958b\u6c34\u98f2\u7528\uff0c\u88dc\u5145\u6d3b\u529b\uff0c\u8b93\u60a8\u80fd\u4ee5\u6700\u4f73\u72c0\u614b\u9762\u5c0d\u5404\u7a2e\u65e5\u5e38\u6311\u6230\uff0c\u6fc0\u767c\u6eff\u6eff\u80fd\u91cf\uff01 <br />  <br />\u62dc\u7dad\u4f73\u597d\u5eb7\u512a\u60e0\ud83d\udce2\ud83d\udce2\ud83d\udce2 <br />\u8cfc\u8cb7\u901a\u8def\uff1amomo\u8cfc\u7269\u7db2 <br />\u512a\u60e0\u671f\u9593\uff1a3/28-4/3 <br />\u512a\u60e0\u5167\u5bb9\uff1a\u539f\u50f9 2,430\uff0cMOMO\u7368\u5bb6\u512a\u60e06\u62981,478 <br />\u5510\u967d\u96de\u9152\u5c4b\u807d\u773e\u9ede\u64ca\u9023\u7d50\u9818\u5238\u518d\u4eab\u6700\u4f4e\u50f9 <br />\ud83d\uded2\ud83d\uded2\u624b\u5200\u6436\u512a\u60e0\uff1a<a href=\"https://reurl.cc/Nqqv2n\" target=\"_blank\">https://reurl.cc/Nqqv2n</a> <br />&nbsp; <br />\u63d0\u9192\u60a8\uff1a\u672c\u7db2\u7ad9\u4e26\u975e\u63d0\u4f9b\u6c11\u773e\u901a\u5831\u526f\u4f5c\u7528\u7684\u7ba1\u9053\uff0c\u5982\u679c\u60a8\u61f7\u7591\u6709\u526f\u4f5c\u7528\u800c\u9700\u8981\u5354\u52a9\uff0c\u8acb\u60a8\u76e1\u901f\u9023\u7d61\u60a8\u7684\u4e3b\u6cbb\u91ab\u5e2b\u6216\u85e5\u5e2b\uff0c\u4ee5\u53d6\u5f97\u9069\u7576\u7684\u91ab\u7642\u5354\u52a9\u3002 <br />\u82e5\u60a8\u9700\u8981\u5411\u62dc\u8033\u901a\u5831\u85e5\u7269\u4e0d\u826f\u4e8b\u4ef6\u7b49\u5b89\u5168\u8cc7\u8a0a\uff0c\u8acb\u4ee5\u96fb\u5b50\u90f5\u4ef6\u65b9\u5f0f\u5bc4\u5230: drugsafety.taiwan@bayer.com \u6216\u76f4\u63a5\u9023\u4e0a https://safetrack-public.bayer.com \u901a\u5831\u81f3\u672c\u516c\u53f8 <br />\u5167\u5be9\u5b57\u865f: CH-20230320-06</p>",
