"description": "<p>\u6700\u8fd1\u6709\u6c92\u6709\u9047\u5230\u8b93\u4f60\u300c\u660e\u660e\u662f\u597d\u610f\uff0c\u537b\u5f88\u8b93\u4eba\u963f\u96dc\u300d\u7684\u4eba\u3001\u4e8b\u3001\u7269\uff1f\u9019\u7a2e\u5fae\u5999\u7684\u611f\u89ba\uff0c\u5c31\u662f\u91d1\u661f\u9032\u7261\u7f8a\u6240\u5e36\u4f86\u7684\uff01 <br />\u91d1\u9032\u7261\u7f8a\u4e0d\u53ea\u5f71\u97ff\u5230\u7261\u7f8a\u5ea7\u672c\u8eab\uff0c\u4e5f\u5c0d12\u661f\u5ea7\u90fd\u6709\u5f71\u97ff\u5462\uff0c\u662f\u7684\uff0c\u9019\u4e00\u96c6\u5c31\u61c9\u666f\u7684\u8b1b\u4e00\u4e0b\u91d1\u661f\u5c0d\u5927\u5bb6\u7684\u5f71\u97ff\u5427\uff08\u7576\u7136\u4e5f\u6703\u8b1b\u5230\u5927\u5bb6\u6700\u611b\u807d\u7684\u6843\u82b1\uff09\uff08\u96d6\u7136\u8d8a\u4f86\u8d8a\u4e0d\u77e5\u9053\u6bcd\u80ce\u55ae\u8eab\u7684\u4eba\u90a3\u9ebc\u611b\u807d\u6843\u82b1\u5e79\u561b\ud83e\udd23\uff09 <br />\u91d1\u661f\u5e36\u4f86\u7684\u90fd\u662f\u597d\u4e8b\uff1f\u5176\u5be6\u4e0d\u7136\uff0c\u5b83\u53ea\u662f\u7a81\u986f\u90a3\u500b\u661f\u5ea7\u7684\u80fd\u91cf\uff0c\u96d6\u7136\u504f\u5584\u610f\uff0c\u4f46\u91d1\u843d\u7261\u7f8a\u7562\u7adf\u662f\u300c\u5f31\u52e2\u4f4d\u300d\uff08\u8d95\u5feb\u7ffb\u524d\u9762\u7684\u5f37\u5f31\u52e2\u4f4d\u8907\u7fd2\u4e00\u4e0b\uff09\uff0c\u8212\u670d\u80fd\u91cf\uff08\u91d1\u661f\uff09\u6389\u5230\u4e0d\u8212\u670d\u7684\u4f4d\u7f6e\uff0c\u611f\u89ba\u5c31\u662f@$#$%*&amp;^%$\u5440\uff08\u5c31\u662f\u9019\u500b\u6708\u7684\u5fc3\u60c5\u5462\ud83d\ude06\uff09 <br /> <br />\uff08\u8a71\u8aaa\u6211\u7684podcast\u4f86\u5230200\u96c6\u4e86\ud83d\ude31\ud83d\ude3d\ud83d\udc83\ud83c\udffb\uff09 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u5982\u4f55\u7576\u500b\u53ef\u611b\u7684\u5c41\u5b69 <br />\u7261\u7f8a\u5ea7\u7684\u5fc3\u60c5\u8b8a\u597d\u4e86 <br />\u5c04\u624b\u5373\u5c07\u516c\u958b... <br />\u7345\u5b50\u5ea7\u7684\u65b0\u751f\u6d3b <br />\u6700\u8fd1\u53c8\u5fd9\u53c8\u723d\u7684\u96d9\u9b5a <br />\u5de8\u87f9\u8ddf\u9577\u5b98\u5fae\u5999\u7684\u95dc\u4fc2 <br />\u5929\u880d\u8ddf\u540c\u4e8b\u7684\u611b\u6068\u4ea4\u96dc <br />\u6bd4\u6c34\u74f6\u66f4\u6709\u500b\u6027\u7684\u670b\u53cb <br />\u5929\u79e4\u5947\u5999\u7684\u4eba\u969b\u95dc\u4fc2 <br />\u61c9\u916c\u5f88\u591a\uff0c\u4f46\u96d9\u5b50\u4e0d\u559c\u6b61\uff1f <br />\u9b54\u7faf\u6709\u5fc3\u4e8b <br />\u8655\u5973\u5ea7\u7684\u6027\u80fd\u91cf <br />\u6700\u8fd1\u91d1\u725b\u7279\u5225\u778e\uff1f</p>",
