"description": "<p>\u672c\u96c6\u63d0\u53ca\uff1a\u571f\u8c61\u661f\u5ea7\uff08\u91d1\u725b\u3001\u8655\u5973\u3001\u9b54\u7faf\uff09 <br />\u661f\u76e4\u4e2d\u300c\u67d0\u661f\u5ea7\u5f37\u6703\u600e\u6a23\u300d\u4f86\u5230\u7b2c\u4e8c\u96c6\uff0c\u4eca\u5929\u8981\u8ac7\u7684\u662f\u571f\u8c61\u661f\u5ea7\u82e5\u5f88\u300c\u5f37\u300d\u6703\u600e\u6a23 <br /> <br />\u55ef\u22ef\uff08\u6df1\u5438\u4e00\u53e3\u6c23\uff09\u53ef\u9760\u5ea6\u6578\u4e00\u6578\u4e8c\uff0c\u56fa\u57f7\u5014\u5f37\u5ea6 \u4e5f\u662f\ud83d\ude02\uff0c\u82e5\u6709\u4eba\u60f3\u8a66\u5716\u6539\u8b8a\u571f\u8c61\uff0c\u6211\u6703\u63d0\u9192\u4f60\uff1a\u4e0d\u53ef\u80fd\u270b\uff0c\u571f\u8c61\u5f37\u7684\u4eba\u4e0d\u662f\u4e0d\u6539\u8b8a\uff0c\u7b49\u81ea\u5df1\u60f3\u8b8a\u7684\u6642\u5019\u5c31\u6703\u8b8a\u4e86\uff0c\u4f46\u4e0d\u53ef\u80fd\u662f\u56e0\u5225\u4eba\u7684\u52f8\u544a\u800c\u8b8a\ud83d\ude1c <br /> <br />\u6240\u4ee5\u7576\u6211\u812b\u53e3\u8aaa\u51fa\uff1a\u4f60\u571f\u8c61\u5f88\u5f37\u543cXD\u22ef\u5c31\u662f\u8eab\u70ba\u5360\u661f\u5e2b\u5167\u5fc3\u5f88\u591aOS\u8ddf\u5167\u5fc3\u7121\u529b\u6642\u22ef\u22ef\ud83e\udd23 <br />\u6b38\uff0c\u4f46\u4f60\u5011\u7684\u512a\u9ede\u4e5f\u4e00\u6a23\u591a\u5566\uff08\u8d95\u7dca\u6d17\u767d\uff09\uff0c\u56e0\u70ba\u300c\u52d9\u5be6\u3001\u5fe0\u8aa0\u3001\u6293\u5730\u529b\u300d\u4e5f\u6703\u4e00\u6a23\u5f37\u5594 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u571f\u8c61\u661f\u5ea7\u5f37=\u6c92\u6709\u6551??? <br />\u7fa4\u661f\u91d1\u725b\u5f88\u8089\u617e\uff1f <br />\u4f60\u5728\u8aaa\u91d1\u725b\u6c92\u6709\u5728\u807d <br />\u751f\u7522\u6700\u591a\u4ed9\u5973\u7684\u661f\u5ea7\uff1f <br />\u8655\u5973\u5f0f\u7684\u8cbc\u5fc3 <br />\u51b7\u6de1\u5230\u770b\u4e0d\u51fa\u5fc3\u71b1\u7684\u9b54\u7faf <br />\u7fa4\u661f\u9b54\u7faf\u82b1\u9322\u62dc\u8a17\u7728\u4e00\u4e0b\u773c</p>",
