"description": "<p>ps.\u5167\u5bb9\u6bd4\u6a19\u984c\u9084\u6709\u5167\u6db5 <br /> <br />\u4eca\u5929\u7684\u5510\u967d\u96de\u9152\u5c4b\u4f86\u4e86\u4e00\u4f4d\u610f\u60f3\u4e0d\u5230\u7684\u5927\u4eba\u7269\uff0c\u4e00\u4ee3\u5927\u5e2b\u517c\u6211\u7684\u5927\u5b78\u8001\u5e2b\u2014\u6797\u61f7\u6c11\u4f86\u4e86\uff01 <br />\u6211\u66fe\u7d93\u8499\u53d7\u4ed6\u89aa\u8eab\u6307\u5c0e\uff08\u5012\u4e0d\u662f\u821e\u8e48\u5566\uff0c\u8df3\u821e\u7684\u8a71\u6211\u5149\u8eab\u6750\u7121\u6cd5\u63a7\u5236\u5c31\u6703\u628a\u4ed6\u6c23\u6b7b\u5427\ud83d\ude06\uff09\uff0c\u4ed6\u89aa\u8eab\u6307\u5c0e\u6211\u7684\uff0c\u7adf\u662f\u22ef\u96fb\u8a71\u79ae\u5100\uff1f <br />\u800c\u4e14\u4ed6\u4e00\u4f86\u5230\u6211\u7684\u5c0f\u9304\u97f3\u5ba4\uff0c\u5c31\u544a\u8a34\u6211\u4ed6\u6b63\u78ba\u7684\u51fa\u751f\u6642\u9593\uff0c\u7136\u5f8c\u53c8\u89e3\u958b\u4e86\u4e00\u4f4d\u5927\u4eba\u7269\u7684\u8eab\u4e16\u4e4b\u8b0e\u22ef\u22ef\u6797\u61f7\u6c11\u8001\u5e2b\u7adf\u7136\u4e0d\u662f\u96d9\u9b5a\u5ea7\uff01\u751f\u65bc\u4ea4\u754c\u9ede\u7684\u4ed6\uff0c\u6642\u9593\u4e00\u500b\u66f4\u52d5\uff0c\u98a8\u96f2\u8b8a\u8272\uff0c\u4ed6\u7adf\u662f\u6c34\u3001\u74f6\u3001\u5ea7\u5566\ud83d\ude31\uff08\u6688\uff09 <br />\u8b93\u6211\u5011\u5e36\u8457\u5168\u65b0\u7684\u8996\u89d2\uff0c\u4f86\u804a\u804a\u6797\u61f7\u6c11\u8001\u5e2b\uff0c\u4ee5\u53ca\u300c\u5df2\u7d93\u9000\u4f11\u7684\u4ed6\u300d\u9664\u4e86\u5fd9\u96f2\u9580\u821e\u96c6\uff0c\u79c1\u4e0b\u90fd\u5728\u5e79\u561b\uff1f\uff08\u6211\u5be6\u5728\u592a\u597d\u5947\u4e00\u500b\u91d1\u661f\u516d\u5bae\u7684\u4eba\uff0c\u8981\u600e\u9ebc\u9000\u4f11\uff09 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u5275\u821e\u5718\u53ea\u662f\u9670\u932f\u967d\u5dee <br />\u539f\u672c\u5169\u5e74\u5c31\u8981\u4ea4\u68d2\u7684\u96f2\u9580 <br />\u6253\u5de5\u4ed4\u6642\u671f\u7684\u5510\u8001\u5e2b <br />\u91d1\u661f\u516d\u5bae\u9000\u4e0d\u4e86\u4f11 <br />\u96f2\u9580\u821e\u96c6\u8ddf\u516b\u65b9\u96f2\u96c6\u7684\u95dc\u4fc2 <br />\u6797\u61f7\u6c11\u8001\u5e2b\u773c\u4e2d\u7684\u521d\u6200 <br />\u8ffd\u5287\u8ffd\u5230\u773c\u775b\u4e7e <br />----------- <br />2023\u96f2\u9580\u4e94\u5341\u9031\u5e74 \u6797\u61f7\u6c11\u300a\u85aa\u50b3\u300b\u516d\u57ce\u5de1\u6f14&nbsp; <br /> <br />\u81fa\u5317\u570b\u5bb6\u6232\u5287\u9662 4/21-4/30 <br />\u81fa\u4e2d\u570b\u5bb6\u6b4c\u5287\u9662\u5927\u5287\u9662 5/5-5/7&nbsp; <br />\u9ad8\u96c4\u885b\u6b66\u71df\u6b4c\u5287\u9662 5/12-14&nbsp; <br />\u82d7\u5317\u85dd\u6587\u4e2d\u5fc3\u6f14\u85dd\u5ef3 5/20-5/21&nbsp; <br />\u5609\u7fa9\u7e23\u8868\u6f14\u85dd\u8853\u4e2d\u5fc3\u6f14\u85dd\u5ef3 5/26-5/28&nbsp; <br />\u81fa\u6771\u85dd\u6587\u4e2d\u5fc3\u6f14\u85dd\u5ef3 6/10 <br />\u552e\u7968\u8cc7\u8a0a <br />&nbsp; <br />http<a href=\"https://www.youtube.com/redirect?event=video_description&amp;redir_token=QUFFLUhqbWV4RGRyNlVsQUl1aWRRSHlNaUJOTkVWYU1UUXxBQ3Jtc0tsQjZQQ3F5dlRjUjVuVXRzY2FCTURaZkdESUNMMFpQVzFCWGc4Q0lybUhKRFVxZWF4LWVRclZOakthckpObktndkZRcEJrNXR0eGh0ZnZ0NXJuSkY0TnVRTmxsVDFuYUNWNWg5bXlnUlg4emtoWlBFTQ&amp;q=https%3A%2F%2Flinktr.ee%2F2023_legacy_taiwantour&amp;v=k4jGNvLyS6o\" target=\"_blank\">s://linktr.ee/2023_legacy_taiwantour</a></p>",
