"description": "<p>\u4eca\u5e74\u7684\u9b3c\u6708\u5fb5\u7a3f\u53c8\u4f86\u4e86\uff0c\u9084\u8a18\u5f97\u53bb\u5e74\u8b93\u5927\u5bb6\u5370\u8c61\u6df1\u523b\u7684\u5154\u5b50\u963f\u80a5\u8ddf\u73a9\u5076\u7dad\u4fee\u5e2b\u55ce\uff1f <br /> <br />\u4e0d\u904e\uff0c\u4eca\u5929\u7684Podcast\u4e0d\u4e00\u6a23\uff0c\u4e0d\u518d\u8b1b\u9b3c\u5687\u4f60\u5011\u4e86\uff0c\u807d\u5b8c\u53ea\u6703\u767c\u73fe\uff0c\u5176\u5be6\u4eba\u771f\u7684\u6bd4\u9b3c\u53ef\u6015 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u4e0d\u5b58\u5728\u7684\u59ca\u59ca <br />\u96d9\u9b5a\u578b\u7684\u6200\u611b\u5c0d\u8c61 <br />\u5e74\u7d00\u4e0d\u662f\u6c34\u74f6\u5ea7\u5728\u610f\u7684 <br />\u8b93\u964c\u751f\u4eba\u4f4f\u9032\u5bb6\u88e1\u768411\u5bae <br />12\u5bae\u4eba\u6e23\u7537\u9451\u5b9a\u5e2b <br />\u6de1\u6c34\u9109\u6751\u9eb5\u5305 <br />\u9577\u5f97\u53ef\u611b\u7684\u91d1\u725b <br />\u8077\u5834\u8b8a\u8ced\u5834 <br />\u4e03\u6a13\u9001\u725b\u5976 <br />\u7f3a\u9322\u6642\u7684\u8ca1\u795e\u5922 <br />-------------- <br /><strong>\u3010\u4fee\u8b77\u96d9\u661f\uff01NO.1\u5c0f\u68d5\u74f6 x \u5168\u65b0\u5347\u7d1a\u5c0f\u68d5\u773c\u3011</strong> <br />\u71ac\u591c\u52a0\u73ed\u8ffd\u5287\uff0c\u819a\u6cc1\u770b\u8d77\u4f86\u8d85\u75b2\u618a\uff01\u5c31\u8b93\u4fee\u8b77\u96d9\u661f\u70ba\u4f60\u5feb\u5145\u7f8e\u808c\u96fb\u529b\uff01 <br />\u261e\u5168\u7403\u71b1\u92b740\u5e74\u7684\u7cbe\u83ef\u6db2\u9738\u4e3bNO.1\u5c0f\u68d5\u74f6\uff08\u7279\u6f64\u8d85\u5c0e\u5168\u65b9\u4f4d\u4fee\u8b77\u9732\uff09 <br />1\u79d2\u5feb\u51457\u5927\u4fee\u8b77\u80fd\u91cf\uff0c\u808c\u819a\u8d85\u5f48\uff01\u8d85\u4eae\uff01\u8d85\u7dca\u7dfb <br />\u261e\u5168\u65b0\u5347\u7d1a\uff01\u5c0f\u68d5\u773c\uff08\u7279\u6f64\u5168\u80fd\u4fee\u8b77\u4eae\u773c\u971c\uff09 \u8d85\u4eae\u773cx\u901f\u4fee\u8b77x\u6975\u4fdd\u6fd5 <br />\u7368\u5bb6\u9ed1\u773c\u5708\u963b\u65b7\u79d1\u6280\uff0c2\u9031\u660e\u4eae\u9ed1\u773c\u5708\uff0c\u4fdd\u6fd5\u6297\u8001\u4fee\u8b77\u7cbe\uff0c100\u5c0f\u6642\u9577\u6548\u4fdd\u6fd5 <br />&nbsp; <br /><strong>\u6b61\u6176\u96c5\u8a69\u862d\u9edb\u5c0f\u68d5\u74f640\u9031\u5e74\uff0c\u751f\u65e5\u5feb\u6a02\uff01</strong> <br /><strong>8/4~8/10 \u6d88\u8cbb\u4eab\u9650\u6642\u512a\u60e0\uff0c\u767e\u8ca8\u5b98\u7db2\u540c\u6b65\u9650\u91cf\u8ca9\u552e\u4e2d\uff1a</strong> <br /><a href=\"https://linktr.ee/esteelauderjessetang11\" target=\"_blank\">https://linktr.ee/esteelauderjessetang11</a> <br />\u3010\u65b0\u670b\u53cb\u63a8\u85a6\uff01\u3011NO.1#\u5c0f\u68d5\u74f6 \u8cb750ml\u900130ml\uff0c\u73fe\u77012520\uff01 <br />\u3010\u68d5\u7c89\u5fc5\u6536\uff01\u3011NO.1#\u5c0f\u68d5\u74f6 \u8cb775ml\u900175ml\uff0c\u53ea\u8981\uff14\u6298\uff01 <br />\u3010<strong>\u6436\u5148\u8a66\u7528\u3011\u586b\u55ae\u514d\u8cbb\u9818\u53d6\uff0c\u8c6a\u83ef\u8a66\u7528\u5c0f\u68d5\u4fee\u8b77\u7f8e\u808c\u5145\u96fb\u7d44</strong> <br />&nbsp;</p>",
