"description": "<p>\u4eca\u5929\u804a\u7684\u662f\uff0c\u548c12\u661f\u5ea7\u300c\u5982\u4f55\u544a\u767d\u300d\u6210\u529f\u7387\u8f03\u9ad8 <br /> <br />\u5361\u863f\u78ba\u8a3a\u4e2d\uff0c\u9019\u4e00\u96c6\u662f\u4e03\u5915\u9304\u97f3\uff0c\u6628\u5929\u7dca\u6025\u627e\u4ee3\u73ed\uff0c\u7a76\u7adf\u8ab0\u4e03\u5915\u90a3\u9ebc\u6709\u7a7a\u4e00\u7d04\u5c31\u4f86\u5462\uff1f\u22ef\u22ef <br /> <br />\u767b\u767b\u767b\u767b\uff5e\u90a3\u5c31\u662f\u2014\u53f0\u901a\u5f35\u5bb6\u502b\u5566XDDD\u8b1d\u8b1d\u4ed6\u7fa9\u6c23\u76f8\u633a \u62d4\u5200\u76f8\u52a9\uff0c\u63d0\u4f9b\u8c50\u5bcc\u7684\u300c\u544a\u767d\u88ab\u62d2\u7d93\u9a57\u300d\u8b93\u672c\u96c6\u5982\u6b64\u8c50\u5bcc\ud83e\udd23 <br /> <br />\u96d6\u7136\u4e03\u5915\u5df2\u904e\uff08\u4e5f\u4e0d\u77e5\u5404\u4f4d\u6709\u6c92\u6709\u6a5f\u6703\u544a\u767d\uff09\uff0c\u9084\u662f\u53ef\u4ee5\u4f86\u807d\u807d\uff0c\u6709\u807d\u6709\u4fdd\u5e87\uff0c\u4e0d\u544a\u767d\u7684\u4e5f\u53ef\u4ee5\u7576\u7b11\u8a71\u807d\ud83d\ude06 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u7261\u7f8a\u5f35\u5bb6\u502b\u7684\u9072\u920d\u75c5 <br />\u544a\u767d\u524d\uff0c\u8acb\u505a\u597d\u7261\u7f8a\u9003\u8dd1\u7684\u5fc3\u7406\u6e96\u5099 <br />\u544a\u767d\u5929\u79e4\u6210\u529f\u5fc3\u6cd5\u5927\u516c\u958b <br />\u96d9\u9b5a\u559c\u6b61\u6478\u6478\uff1f <br />\u8655\u5973\u5176\u5be6\u8d85\u611b\u9a5a\u559c\uff1f <br />\u548c\u7345\u5b50\u544a\u767d\uff0c\u6bd4\u8f03\u7d1a\u60c5\u8a71\u5f88\u7ba1\u7528 <br />\u5de8\u87f9\uff1a\u4f60\u4e0d\u611b\u4ed6\uff0c\u4ed6\u5c31\u6703\u611b\u4f60 <br />\u6b61\u8fce\u6709\u75c5\u7684\u4eba\u627e\u5584\u826f\u7684\u5929\u880d <br />\u6c34\u74f6\u7684\u611f\u89ba\uff0c\u53ea\u6709\u81ea\u5df1\u77e5\u9053 <br />\u5c0d\u9b54\u7faf\u7684\u60c5\u8a71\u4e0d\u8981\u592a\u597d\u807d <br />\ud83d\udd1e\u5c04\u624b\u8aa0\u8aa0\u8a8d\u8b49\uff0c\u4ea4\u5f80\u524d\u76f4\u63a5\u8a66\u8ecaOK <br /> <br />--------------------------------------- <br /> <br />\u3010\u90f5\u653f\u6578\u4f4d\u5e33\u6236 \u7cbf\u7136\u90f5\u597d\u79ae\u3011 <br />111/8/1~10/31\u6709\u90f5\u653f\u6578\u4f4d\u5e33\u6236\u7684\u670b\u53cb\u5225\u932f\u904e\uff0c\u6c92\u6709\u6578\u4f4d\u5e33\u6236\u7684\u670b\u53cb\u4e5f\u53ef\u4ee5\u6e96\u5099\u7533\u8fa6\u56c9\uff01 <br />\u767b\u5165\u884c\u52d5\u90f5\u5c40APP\u62bdiPhone 13 Pro\u7b49\u597d\u79ae <br />\u5927\u5b78\u6821\u5712\u90f5\u5c40\u63a8\u85a6\u65b0\u6236\u5c31\u62bd\u722d\u9bae300\u5143\u5238 <br />\u6578\u4f4d\u5e33\u6236\u5237\u5361\u6eff\u984d\u9001\u535a\u5ba2\u4f86500\u5143\u96fb\u5b50\u79ae\u7269\u5361 <br />\u4e2d\u83ef\u90f5\u653f\u5927\u65b9\u9001\u597d\u79ae\uff0c\u8d95\u5feb\u4f86\u53c3\u52a0\uff01 <br />\u6d3b\u52d5\u8a73\u60c5\u8acb\u6d3d\u4e2d\u83ef\u90f5\u653f\u6d3b\u52d5\u5b98\u7db2\uff1a<a href=\"https://lottery.post.gov.tw/digit2022\" target=\"_blank\">https://lottery.post.gov.tw/digit2022</a></p>",
