"description": "<p>\u6728\u661f\u5728\u96d9\u9b5a\u885d\u523a\uff01\u96d9\u9b5a\u80fd\u91cf\u7206\u5f37\uff0c\u5f71\u97ff\u5c31\u662f\u22ef\u22ef\u22ef <br />\u8a50\u9a19\u4e36\u5047\u8ca8\u4e36\u5047\u65b0\u805e\u8b8a\u66f4\u591a\uff0c\u9084\u9644\u52a0\u4e94\u91cc\u9727\u4e36\u61f6\u6d0b\u6d0b\u7684\u611f\u89ba\u2026 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u6700\u8fd1\u96d9\u9b5a\u80fd\u91cf\u5f37\u554a <br />\u96d9\u9b5a\u8ddf\u8a50\u9a19\u6709\u95dc <br />\u9023\u8001\u5e2b\u90fd\u88ab\u8a50\u9a19 <br />\u516c\u5bb6\u6a5f\u95dc\u5c0d\u4e0d\u8d77 <br />\u95dc\u65bc\u6700\u8fd1\u7684\u7121\u529b\u611f <br />\u96d9\u9b5a\u5ea7\u7684\u8001\u9748\u9b42 <br />\u5b9c\u4ee5\u9000\u70ba\u9032 <br />\u88dd\u53ef\u6190\u53ef\u6065\u537b\u6709\u7528\uff1f <br />\u6700\u8fd1\u7684\u96d9\u9b5a\u5ea7\u53c8\u5fd9\u53c8\u7d05\uff1f <br />\u5fc3\u6e56\u6700\u8fd1\u4e00\u76f4\u8569\u6f3e\ud83d\ude0d <br />----------------------- <br />\u672c\u96c6\u7531\u3010TT\u6ce2\u7279\u5ada\u3011\u6296\u5167\u64ad\u51fa <br /> <br />\u5510\u8001\u5e2b\u4ee3\u8a00TT\u6ce2\u7279\u5ada\u9762\u819c\u7b2c\u56db\u5e74\u5566\uff01 <br />\u4eca\u5e74\u9996\u6b21\u89aa\u81ea\u53c3\u8207\u7814\u767c\u8a2d\u8a08\uff0c\u63a8\u51fa\u300c\u56db\u5b63\u9762\u819c\u300d\u79ae\u76d2\u7d44\ud83d\udc4f\ud83d\udc4f\ud83d\udc4f <br />\u91dd\u5c0d\u5b63\u7bc0\u8b8a\u63db\u8207\u4e0d\u540c\u819a\u6cc1\u800c\u8a2d\u8a08\u2728\u2728\u7d66\u5927\u5bb6\u4e00\u5e74\u56db\u5b63\u7684\u966a\u4f34\u548c\u5475\u8b77\uff01 <br /> <br />\u3010\u819c\u6cd5\u7dba\u808c\u690d\u8403\u56db\u5b63\u9762\u819c\u79ae\u76d2\u7d44\u3011(20\u5165/\u7d44) <br />\u6625\u5b63\u2192\u8212\u7de9\u8ce6\u6d3b\u7fbd\u7d72\u67d4\u9762\u819c <br />\u590f\u5b63\u2192\u6c81\u900f\u4fdd\u6fd5\u51b0\u51b0\u9762\u819c <br />\u79cb\u5b63\u2192\u6676\u900f\u6de8\u984f\u9ed1\u9762\u819c <br />\u51ac\u5b63\u2192\u6ecb\u990a\u5ae9\u767d\u6c23\u588a\u9762\u819c <br /> <br />\ud83d\udc49\u5b98\u7db2\u512a\u60e0\uff1a\u5373\u65e5\u8d77\u81f35/15 <br />\u3010\u819c\u6cd5\u7dba\u808c\u690d\u8403\u56db\u5b63\u9762\u819c\u79ae\u76d2\u7d44\u3011\u512a\u60e0\u50f9$1344/\u7d44(\u5b9a\u50f9$1680) <br />\ud83c\udf89\u6d88\u8cbb\u6eff$2000\u90017-11\u79ae\u7269\u5361$200(\u53ef\u7d2f\u8d08)\uff0c <br />\ud83c\udf89\u4e00\u6b21\u8cfc\u8cb7\u5169\u7d44\u9084\u6709\u6a5f\u6703\u7372\u5f97\u5510\u8001\u5e2b\u89aa\u7b46\u7c3d\u540d\u7684\u79ae\u76d2\u7d44(\u9650\u91cf) <br /> <br />\u203bTT\u6ce2\u7279\u5ada\u7684\u7522\u54c1\u5747\u901a\u904e\u5316\u599d\u54c1GMP\u8a8d\u8b49\uff0c\u88fd\u7a0b\u5c64\u5c64\u628a\u95dc\u3001\u5b89\u5fc3\u53ef\u9760\uff01</p>",
