"description": "<p>\u6211\u7684\u5927\u5b78\u540c\u5b78\uff0c\u90ce\u7956\u7b60\u4f86\u4e86\uff01\u8a18\u61b6\u529b\u8d85\u597d\u7684\u5979\u679c\u7136\u53c8\u7206\u4e86\u5f88\u591a\u6599\u2026\u771f\u7684\u662f\u543c <br />\u5e36\u4f60\u5011\u8a8d\u8b58\u5947\u5999\u7684\u5979\uff0c\u5979\u7684\u7e8c\u822a\u529b\u9a5a\u4eba\u6839\u672c\u4e0d\u50cf\u4e09\u5206\u9418\u71b1\u5ea6\u7684\u7261\u7f8a\u3002\u800c\u4e14\uff0c\u660e\u660e\u662f\u57fa\u7763\u5f92\uff0c\u537b\u70ba\u4e86\u6232\u5b78\u4e86\u5f88\u591a\u6cd5\u8853\u5492\u8a9e\uff0c\u662f\u4e0d\u662f\u5f88\u5947\u5999\ud83d\ude02 <br /> <br />Podcast\u66f4\u65b0\uff01 <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u571f\u661f\u4e5d\u5bae\u6709\u591a\u611b\u7d19\u672c\u66f8\uff1f <br />\u66f8\u6253\u5728\u81c9\u4e0a\u6bd4\u8f03\u4e0d\u75db <br />\u524d\u9762\u70ba\u4ec0\u9ebc\u8b8a\u9748\u7570\u4e3b\u984c <br />\u706b\u8c61\u661f\u5ea7\u7684\u654f\u611f\u9ad4\u8cea <br />\u5287\u5834\u88e1\u7684\u90fd\u5e02\u50b3\u8aaa <br />\u73fe\u4ee3\u7248\u7684\u9b54\u6cd5\u963f\u5b24\u9577\u600e\u6a23\uff1f <br />\u62db\u724c\u662f\u908a\u5435\u67b6\u908a\u54ed\u7684\u5510\u8001\u5e2b <br />\u821e\u53f0\u5287\u7684\u7a81\u767c\u72c0\u6cc1\u90fd\u662f\u771f\u7684\uff01 <br />\u57fa\u7763\u5f92\u537b\u5b78\u4e86\u5f88\u591a\u4f5b\u6cd5XD <br />\u5927\u5b78\u806f\u8003\u6709\u5012\u6263\u662f\u4e0d\u662f\u5f88\u8b8a\u614b\uff1f <br />------------- <br /><strong>\u8d85\u7d1a\u7d93\u5178\u7684\u300a\u9b54\u6cd5\u963f\u5abd\u300b\u6f14\u51fa\u8cc7\u8a0a\uff1a</strong> <br />\u4e00\u5b9a\u4e0d\u5c11\u4eba\u770b\u904e\u5427\uff1f\u90a3\u4f60\u4e00\u5b9a\u8981\u4f86\u770b\u770b\u821e\u53f0\u5287\u7248\u7684\u9b54\u6cd5\u963f\u5abd\uff0c\u7d50\u5408\u73fe\u4ee3\u5143\u7d20\u30013D\u7248\u7684\u9748\u7570\u4e16\u754c\u3001\u7576\u7136\u5c11\u4e0d\u4e86\u53f0\u7063\u6fc3\u6fc3\u7684\u4eba\u60c5\u5473\uff0c\u6839\u672c\u5c31\u662f\u5728\u5287\u5834\u88e1\u65bd\u9b54\u6cd5\uff01 <br /> <br />\u3010\u5287\u60c5\u7c21\u4ecb\u3011 <br />\u53db\u9006\u671f\u7684\u8c46\u8c46\u56e0\u70ba\u8abf\u76ae\u6417\u86cb\uff0c\u88ab\u5abd\u5abd\u5e36\u5230\u963f\u5abd\u5bb6\u53cd\u7701\uff0c\u7981\u8db3\u671f\u9593\u8c46\u8c46\u610f\u5916\u6495\u6389\u7b26\u5492\uff0c\u5f15\u51fa\u5996\u602a\u9644\u8eab\u5728\u9ed1\u8c93\u9177\u7f85\u8eab\u4e0a\uff0c\u4ed6\u544a\u8a34\u6211\u53ea\u8981\u6536\u96c6\u5230\u4e09\u6ef4\u963f\u5abd\u7684\u773c\u6dda\uff0c\u5c31\u53ef\u4ee5\u96e2\u958b\u9019\u88e1\u3002\u662f\u4e0d\u662f\u5c0d\u9019\u500b\u5287\u60c5\u5f88\u719f\u6089\uff01 <br /> <br />\u6f14\u51fa\u5730\u9ede\u8207\u6642\u9593\uff1a <br />\u2013\u53f0\u5317 \u570b\u7236\u7d00\u5ff5\u9928 \u2192 4/15~4/17 <br />\u2013\u53f0\u4e2d \u4e2d\u5c71\u5802 \u2192 4/30 <br />\u2013\u9ad8\u96c4 \u81f3\u5fb7\u5802 \u2192 5/21 <br />\u2013\u53f0\u5357 \u6587\u5316\u4e2d\u5fc3\u6f14\u85dd\u5ef3 \u2192 7/2 <br /> <br />\u5510\u8001\u5e2b\u5c08\u5c6c\u6298\u6263\u78bc\u3010tang11190\u3011 <br />\u9019\u88e1\u8cb7\u7968\uff1a<a href=\"https://reurl.cc/zMn977\" target=\"_blank\">https://reurl.cc/zMn977</a></p>",
