"description": "<p>\u672c\u96c6\u63d0\u5230: \u706b\u661f\u3001\u6c34\u661f\u3001\u571f\u661f\u3001\u51a5\u738b\u661f <br /> <br />\u4e0d\u50cf\u524d\u5e7e\u7d44\uff0c\u9019\u96c6\u4e0a\u699c\u7684\u5404\u4f4d\uff0c\u90fd\u98c4\u6563\u8457\u4e00\u80a1\u7528\u547d\u5728\u5de5\u4f5c\u7684\u611f\u89ba\ud83d\ude02 <br />\u9019\u96c6\u7684\u90fd\u662f\u58ef\u58eb\u554a\u2026 <br /> <br />\u672c\u65e5\u83dc\u55ae\uff1a <br />\u8077\u5834\u5200\u5149\u528d\u5f71\u7684\u706b\u516d\u5bae <br />\u884c\u8d70\u7684\u8077\u5834\u70b8\u5f48 <br />\u706b\u516d\u5bae\u4e0d\u5c0f\u5fc3\u5c31\u8b8a\u7bad\u9776 <br />\u9ede\u5b50\u738b\u6c34\u661f\u516d\u5bae <br />\u53ef\u4ee5\u52d5\u8166\u52d5\u5634\uff0c\u4e0d\u52d5\u8eab\u9ad4 <br />\u8077\u5834\u5bae\u4f4d\u6709\u571f\u661f\u6703\u2026\uff1f <br />\u571f\u661f\u5176\u5be6\u662f\u8212\u9069\u5708 <br />\u4e0d\u8981\u5c0f\u770b\u51a5\u738b\u661f\u7684\u9ed1\u8272\u529b\u91cf <br />\u88ab\u8667\u5f85\u4e86\u4e8b\u696d\u5c31\u6210\u529f\u4e86 <br />\u8981\u5c0f\u5fc3\u592a\u57f7\u8457 <br />----------------------- <br /><strong>\u300a\u6975\u897f\u4e4b\u5730\u6709\u500b\u8cbb\u7279\u5152\u300b\u7bc0\u76ee\u8cc7\u8a0a</strong> <br />\u6642\u9593\uff1a110\u5e7411\u670813\u65e5\u300111\u670814\u65e5&nbsp;\u4e0b\u534814:30 <br />\u5730\u9ede\uff1a\u81fa\u7063\u6232\u66f2\u4e2d\u5fc3\u5927\u8868\u6f14\u5ef3\uff08\u81fa\u5317\u5e02\u58eb\u6797\u5340\u6587\u6797\u8def751\u865f\uff09 <br />\u4e3b\u6f14\uff1a\u6731\u5b89\u9e97\u3001\u76db\u9451\u3001\u8b1d\u51a0\u751f <br />\u770b\u66f4\u591a\uff1a<a href=\"https://www.opentix.life/event/1431172567083958274\" target=\"_blank\">https://www.opentix.life/event/1431172567083958274</a> <br />&nbsp;</p>",
